INSERT INTO zn_zi_part VALUES('元','12407',NULL,NULL,NULL,'一','兀',NULL,NULL,NULL,NULL,NULL,NULL,'2023-12-25 19:45:40','始也。从一从兀。','Y','2','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('吏','6463',NULL,NULL,NULL,'一','史',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'治人者也。从一从史，史亦聲。','Y','5','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('祏','9358',NULL,'礻',NULL,NULL,'石',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'宗廟主也。《周禮》有郊、宗、石室。一曰大夫以石爲主。从示从石，石亦聲。','Y','39',NULL,NULL);
INSERT INTO zn_zi_part VALUES('祝','13211',NULL,'礻',NULL,NULL,'兄',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-29 21:02:52','祭主贊詞者。从示从人口。一曰从兌省。《易》曰：“兌爲口爲巫。”。','Y','47','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('祟','9744',NULL,NULL,NULL,'出',NULL,'示',NULL,NULL,NULL,NULL,NULL,NULL,'神禍也。从示从出。','Y','68','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('琥','4576',NULL,'王',NULL,NULL,'虎',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'發兵瑞玉，爲虎文。从玉从虎，虎亦聲。《春秋傳》曰：“賜子家雙琥。”','Y','111',NULL,NULL);
INSERT INTO zn_zi_part VALUES('琀','4300',NULL,'王',NULL,NULL,'含',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'送死口中玉也。从玉从含，含亦聲。','Y','203',NULL,NULL);
INSERT INTO zn_zi_part VALUES('班','1455',NULL,'王',NULL,NULL,'刂',NULL,NULL,'王',NULL,NULL,NULL,'2024-01-21 08:55:45','分瑞玉。从𤤴从刀。','Y','222','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('士','9390',NULL,NULL,NULL,NULL,'十','一',NULL,NULL,NULL,NULL,NULL,NULL,'事也。數始於一，終於十。从一从十。孔子曰：“推十合一爲士。”凡士之屬皆从士。','Y','226','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('毒','3179',NULL,NULL,NULL,'丰',NULL,'母',NULL,NULL,NULL,NULL,NULL,'2024-01-26 22:28:39','厚也。害人之艸，往往而生。从屮从毒。','Y','236','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('熏','11410',NULL,'屮',NULL,NULL,NULL,NULL,NULL,'黑',NULL,NULL,NULL,NULL,'火煙上出也。从屮从黑。屮黑，熏黑也。','Y','239','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('蓏','7018',NULL,NULL,NULL,'艹','㼌',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'在木曰果，在地曰蓏。从艸从㼌。','Y','242',NULL,NULL);
INSERT INTO zn_zi_part VALUES('芝','12965',NULL,NULL,NULL,'艹','之',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'神艸也。从艸从之。','Y','243','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('苷','3822',NULL,NULL,NULL,'艹','甘',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'甘艸也。从艸从甘。','Y','302',NULL,NULL);
INSERT INTO zn_zi_part VALUES('蒐','9654',NULL,NULL,NULL,'艹','鬼',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'茅蒐，茹藘。人血所生，可以染絳。从艸从鬼。','Y','383',NULL,NULL);
INSERT INTO zn_zi_part VALUES('苗','7360',NULL,NULL,NULL,'艹','田',NULL,NULL,NULL,NULL,NULL,NULL,'2023-12-25 17:19:49','艸生於田者。从艸从田。','Y','543','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('芟','9132',NULL,NULL,NULL,'艹','殳',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'刈艸也。从艸从殳。','Y','579',NULL,NULL);
INSERT INTO zn_zi_part VALUES('萅','2526',NULL,NULL,NULL,'艹','日',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'推也。从艸从日，艸春時生也；屯聲。','Y','682',NULL,NULL);
INSERT INTO zn_zi_part VALUES('莽','7126',NULL,NULL,NULL,NULL,'犬',NULL,NULL,NULL,NULL,'茻',NULL,'2024-01-20 13:01:54','南昌謂犬善逐菟艸中爲莽。从犬从茻，茻亦聲。','Y','702','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('分','37',NULL,NULL,NULL,'八',NULL,'刀',NULL,NULL,NULL,NULL,NULL,NULL,'別也。从八从刀，刀以分別物也。','Y','708','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('曾','2031',NULL,NULL,NULL,'八',NULL,'曰',NULL,NULL,NULL,NULL,NULL,'2024-01-27 17:13:22','詞之舒也。从八从曰，𡆧聲。','Y','710','in HSK / incomplete',NULL);
INSERT INTO zn_zi_part VALUES('詹','12721',NULL,NULL,NULL,'厃','八','言',NULL,NULL,NULL,NULL,NULL,'2024-01-25 22:21:55','多言也。从言从八从厃。','Y','713',NULL,NULL);
INSERT INTO zn_zi_part VALUES('介','5428',NULL,NULL,NULL,'人',NULL,'八',NULL,NULL,NULL,NULL,NULL,'2024-01-14 13:22:55','畫也。从八从人。人各有介。','Y','714','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('公','3976',NULL,NULL,NULL,'八',NULL,'厶',NULL,NULL,NULL,NULL,NULL,'2024-01-14 13:18:10','平分也。从八从厶。(音司。)八猶背也。韓非曰：背厶爲公。','Y','716','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('悉','10704',NULL,NULL,NULL,'釆',NULL,'心',NULL,NULL,NULL,NULL,NULL,NULL,'詳盡也。从心从釆。','Y','722','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('半','1470',NULL,NULL,NULL,'','',NULL,NULL,NULL,NULL,NULL,'','2025-02-08 16:46:47','物中分也。从八从牛。牛爲物大，可以分也。凡半之屬皆从半。','Y','724','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('胖','7920',NULL,'月',NULL,NULL,'半',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-27 01:16:22','半體肉也。一曰廣肉。从半从肉，半亦聲。','Y','725','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('告','3889',NULL,NULL,NULL,'⺧',NULL,'口',NULL,NULL,NULL,NULL,NULL,'2025-02-02 08:54:48','牛觸人，角箸橫木，所以告人也。从口从牛。《易》曰：“僮牛之告。”凡告之屬皆从告。','Y','777','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('吹','2505',NULL,'口',NULL,NULL,'欠',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-16 22:57:50','噓也, 出气也, 从口从欠。','Y','828','in HSK','blow');
INSERT INTO zn_zi_part VALUES('名','7420',NULL,NULL,NULL,'夕','口',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-15 13:16:46','自命也。从口从夕。夕者，冥也。冥不相見，故以口自名。','Y','835','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('命','7436',NULL,NULL,NULL,'人','一','叩',NULL,NULL,NULL,NULL,NULL,'2024-01-26 16:21:36','使也。从口从令。','Y','839','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('咠','8331',NULL,NULL,NULL,'口',NULL,'耳',NULL,NULL,NULL,NULL,NULL,'2024-01-18 20:55:11','聶語也。从口从耳。《詩》曰：“咠咠幡幡。”','Y','857',NULL,NULL);
INSERT INTO zn_zi_part VALUES('启','8315',NULL,NULL,NULL,'户','口',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-23 22:47:17','開也。从戶从口。','Y','869','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('咸','10905',NULL,NULL,NULL,NULL,'戌',NULL,NULL,NULL,NULL,NULL,'口','2024-01-27 00:26:07','監持意。口閉也。从欠緘聲。','Y','871','',NULL);
INSERT INTO zn_zi_part VALUES('唬','4574',NULL,'口',NULL,NULL,'虎',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'嗁聲也。一曰虎聲。从口从虎。讀若暠。','Y','953','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('咍','4269',NULL,'口',NULL,NULL,'台',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'蚩笑也。从口从台。','Y','966',NULL,NULL);
INSERT INTO zn_zi_part VALUES('此','135',NULL,'止',NULL,NULL,NULL,NULL,NULL,'匕',NULL,NULL,NULL,NULL,'止也。从止从匕。匕，相比次也。凡此之屬皆从此。','Y','1082','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('些','11069',NULL,NULL,NULL,'此',NULL,'二',NULL,NULL,NULL,NULL,NULL,'2024-01-26 16:35:34','語辭也。見《楚辭》。从此从二。其義未詳。','Y','1085','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('辵','2562',NULL,'彳',NULL,NULL,'止',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'乍行乍止也。从彳从止。凡辵之屬皆从辵。讀若《春秋公羊傳》曰“辵階而走”。','Y','1091',NULL,NULL);
INSERT INTO zn_zi_part VALUES('返','3465',NULL,NULL,'辶',NULL,'反',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'還也。从辵从反，反亦聲。《商書》曰：“祖甲返。”','Y','1140','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('逐','13184',NULL,NULL,'辶',NULL,'豕',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 23:23:57','追也。从辵，从豚省。','Y','1177','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('道','2893',NULL,NULL,'辶',NULL,'首',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 23:24:33','所行道也。从辵从𩠐。一達謂之道。','Y','1204','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('御','12351',NULL,'彳',NULL,NULL,'卸',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'使馬也。从彳从卸。','Y','1257','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('建','5196',NULL,NULL,'廴',NULL,'聿',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-26 22:37:01','立朝律也。从聿从廴。','Y','1262','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('行','4344',NULL,'彳',NULL,NULL,'亍',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'人之步趨也。从彳从亍。凡行之屬皆从行。','Y','1265','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('路','226',NULL,'足',NULL,NULL,NULL,NULL,NULL,'各',NULL,NULL,NULL,NULL,'道也。从足从各。','Y','1407','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('舌','9220',NULL,NULL,NULL,'千',NULL,'口',NULL,NULL,NULL,NULL,NULL,'2024-01-15 13:22:03','在口，所以言也、別味也。从干从口，干亦聲。凡舌之屬皆从舌。','Y','1437','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('㕯','7621',NULL,'',NULL,NULL,'内',NULL,NULL,NULL,NULL,NULL,'口','2025-04-02 22:56:50','言之訥也。从口从内。凡㕯之屬皆从㕯。','Y','1447',NULL,NULL);
INSERT INTO zn_zi_part VALUES('矞','12349',NULL,NULL,NULL,'矛',NULL,'冏',NULL,NULL,NULL,NULL,NULL,'2024-01-27 23:03:56','以錐有所穿也。从矛从㕯。一曰滿有所出也。','Y','1448',NULL,NULL);
INSERT INTO zn_zi_part VALUES('拘','5628',NULL,'扌',NULL,NULL,'句',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-26 16:13:02','止也。从句从手，句亦聲。','Y','1451','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('笱','4018',NULL,NULL,NULL,'⺮','句',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'曲竹捕魚笱也。从竹从句，句亦聲。','Y','1452',NULL,NULL);
INSERT INTO zn_zi_part VALUES('千','8363',NULL,NULL,NULL,'丿','十',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-14 14:33:00','十百也。从十从人。','Y','1461','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('肸','10830',NULL,'十',NULL,NULL,NULL,NULL,NULL,'䏌',NULL,NULL,NULL,NULL,'響，布也。从十从䏌。','Y','1462',NULL,NULL);
INSERT INTO zn_zi_part VALUES('博','1872',NULL,'十',NULL,NULL,NULL,NULL,NULL,'尃',NULL,NULL,NULL,NULL,'大通也。从十从尃。尃，布也。','Y','1464','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('信','11166',NULL,'亻',NULL,NULL,'言',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-17 01:19:25','誠也。从人从言。會意。','Y','1519','in HSK','trust, believe, faith');
INSERT INTO zn_zi_part VALUES('警','5531',NULL,NULL,NULL,'敬',NULL,'言',NULL,NULL,NULL,NULL,NULL,'2024-01-21 09:15:54','戒也。从言从敬，敬亦聲。','Y','1550','in HSK','advice / suggestion');
INSERT INTO zn_zi_part VALUES('諕','4359',NULL,'言',NULL,NULL,'虎',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 21:31:53','號也。从言从虎。','Y','1652',NULL,NULL);
INSERT INTO zn_zi_part VALUES('譱','9156',NULL,'誩',NULL,NULL,NULL,NULL,NULL,'羊',NULL,NULL,NULL,NULL,'吉也。从誩从羊。此與義美同意。','Y','1728',NULL,NULL);
INSERT INTO zn_zi_part VALUES('竟','5548',NULL,NULL,NULL,'音',NULL,'儿',NULL,NULL,NULL,NULL,NULL,'2024-01-27 12:22:54','樂曲盡爲竟。从音从人。','Y','1736','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('妾','8535',NULL,NULL,NULL,'立',NULL,'女',NULL,NULL,NULL,NULL,NULL,'2024-01-25 22:18:52','有辠女子，給事之得接於君者。从䇂从女。《春秋》云：“女爲人妾。”妾，不娉也。','Y','1740',NULL,NULL);
INSERT INTO zn_zi_part VALUES('菐','8201',NULL,'丵',NULL,NULL,NULL,NULL,NULL,'廾',NULL,NULL,NULL,NULL,'瀆菐也。从丵从廾，廾亦聲。凡菐之屬皆从菐。','Y','1745',NULL,NULL);
INSERT INTO zn_zi_part VALUES('丞','2255',NULL,'卩',NULL,NULL,NULL,NULL,NULL,'山',NULL,NULL,NULL,NULL,'翊也。从廾从卩从山。山高，奉承之義。','Y','1750',NULL,NULL);
INSERT INTO zn_zi_part VALUES('弇','11574',NULL,'廾',NULL,NULL,NULL,NULL,NULL,'合',NULL,NULL,NULL,NULL,'蓋也。从廾从合。','Y','1752',NULL,NULL);
INSERT INTO zn_zi_part VALUES('具','5683',NULL,NULL,NULL,'目','一','八',NULL,NULL,NULL,NULL,NULL,'2024-01-26 16:13:39','共置也。从廾，从貝省。古以貝爲貨。','Y','1764','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('樊','3444',NULL,NULL,NULL,'棥',NULL,'大',NULL,NULL,NULL,NULL,NULL,'2024-01-25 02:09:20','鷙不行也。从𠬜从棥，棥亦聲。','Y','1766','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('舁','12267',NULL,'𦥑',NULL,NULL,NULL,NULL,NULL,'廾',NULL,NULL,NULL,NULL,'共舉也。从𦥑从廾。凡舁之屬皆从舁。讀若余。','Y','1772',NULL,NULL);
INSERT INTO zn_zi_part VALUES('鞣','8919',NULL,'革',NULL,NULL,'柔',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'耎也。从革从柔，柔亦聲。','Y','1789',NULL,NULL);
INSERT INTO zn_zi_part VALUES('靼','2747',NULL,'革',NULL,NULL,'旦',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'柔革也。从革，从旦聲。','Y','1790',NULL,NULL);
INSERT INTO zn_zi_part VALUES('孚','3661',NULL,NULL,NULL,'爪',NULL,'子',NULL,NULL,NULL,NULL,NULL,'2024-11-30 23:05:52','','Y','1873',NULL,NULL);
INSERT INTO zn_zi_part VALUES('右','167',NULL,NULL,NULL,'又','口',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'手口相助也。从又从口。','Y','1896','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('厷','3980','又',NULL,NULL,NULL,'厶',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 18:57:20','臂上也。从又，从古文。','Y','1897',NULL,NULL);
INSERT INTO zn_zi_part VALUES('燮','11126','火',NULL,NULL,'言',NULL,'又','火',NULL,NULL,NULL,NULL,'2024-01-21 09:17:16','和也。从言从又、炎。籒文𤎬从𢆉。𢆉，音飪。讀若溼。','Y','1902',NULL,NULL);
INSERT INTO zn_zi_part VALUES('及','4928',NULL,'又',NULL,NULL,NULL,NULL,NULL,'人',NULL,NULL,NULL,NULL,'逮也。从又从人。','Y','1910','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('取','8726',NULL,'耳',NULL,NULL,NULL,NULL,NULL,'又',NULL,NULL,NULL,'2024-01-21 19:01:52','捕取也。从又从耳。《周禮》：“獲者取左耳。”《司馬法》曰：“載獻聝。”聝者，耳也。','Y','1918','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('隶','216',NULL,NULL,NULL,'⺺','水',NULL,NULL,NULL,NULL,NULL,NULL,'2024-02-18 20:10:47','及也。从又，从㞑省。又，持㞑者，从後及之也。凡隶之屬皆从隶。','Y','1938','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('杸','9460',NULL,'木',NULL,NULL,'',NULL,NULL,'殳',NULL,NULL,NULL,'2025-02-16 12:52:54','軍中士所持殳也。从木从殳。《司馬法》曰：“執羽从杸。”','Y','1950',NULL,NULL);
INSERT INTO zn_zi_part VALUES('役','11908',NULL,'彳',NULL,NULL,NULL,NULL,NULL,'殳',NULL,NULL,NULL,'2024-01-23 22:58:29','戍邊也。从殳从彳。','Y','1966','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('寸','2699',NULL,NULL,NULL,NULL,'又',NULL,NULL,NULL,NULL,NULL,'一','2024-01-21 19:03:44','十分也。人手卻一寸，動𧖴，謂之寸口。从又从一。凡寸之屬皆从寸。','Y','1973','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('政','12936',NULL,NULL,NULL,NULL,'正',NULL,NULL,'攵',NULL,NULL,NULL,NULL,'正也。从攴从正，正亦聲。','Y','1998','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('攸','12174',NULL,'亻 丨',NULL,NULL,NULL,NULL,NULL,'攵',NULL,NULL,NULL,'2024-01-27 13:01:42','行水也。从攴从人，水省。','Y','2026',NULL,NULL);
INSERT INTO zn_zi_part VALUES('寇','6017',NULL,'元',NULL,'宀',NULL,NULL,NULL,'攴',NULL,NULL,NULL,'2024-01-27 12:24:20','暴也。从攴从完。','Y','2035','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('鼓','4087','',NULL,'',NULL,'',NULL,NULL,NULL,NULL,NULL,NULL,'2025-02-08 16:47:11','擊鼓也。从攴从壴，壴亦聲。','Y','2041','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('𠩺','10775','未',NULL,NULL,NULL,NULL,'厂','攵',NULL,NULL,NULL,NULL,'2024-01-21 08:39:13','坼也。从攴从厂。厂之性坼，果孰有味亦坼。故謂之𠩺，从未聲。','Y','2048',NULL,NULL);
INSERT INTO zn_zi_part VALUES('牧','7527',NULL,NULL,NULL,NULL,'牛',NULL,NULL,'攵',NULL,NULL,NULL,NULL,'養牛人也。从攴从牛。《詩》曰：“牧人乃夢。”','Y','2060','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('教','5279',NULL,'孝',NULL,NULL,NULL,NULL,NULL,'攵',NULL,NULL,NULL,'2024-01-27 10:14:43','上所施下所效也。从攴从孝。凡教之屬皆从教。','Y','2064','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('占','12711',NULL,NULL,NULL,'卜','口',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-15 12:35:25','視兆問也。从卜从口。','Y','2071','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('用','12167',NULL,NULL,NULL,NULL,'月',NULL,NULL,NULL,NULL,NULL,'丨','2024-01-15 12:33:20','可施行也。从卜从中。衞宏說。凡用之屬皆从用。','Y','2074','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('庸','12130','',NULL,NULL,'庚','','用',NULL,NULL,NULL,NULL,NULL,'2025-02-16 08:09:56','用也。从用从庚。庚，更事也。《易》曰：“先庚三日。”','Y','2076','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('爽','9541',NULL,NULL,NULL,NULL,'大',NULL,NULL,NULL,NULL,NULL,'㸚','2024-01-27 10:53:52','明也。从㸚从大。','Y','2083','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('相','10978',NULL,'木',NULL,NULL,'目',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-19 00:03:05','省視也。从目从木。《易》曰：“地可觀者，莫可觀於木。”《詩》曰：“相鼠有皮。”','Y','2154','in HSK','phase');
INSERT INTO zn_zi_part VALUES('眇','7365',NULL,'目',NULL,NULL,'少',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'一目小也。从目从少，少亦聲。','Y','2185',NULL,NULL);
INSERT INTO zn_zi_part VALUES('皆','5371',NULL,NULL,NULL,'比',NULL,'白',NULL,NULL,NULL,NULL,NULL,'2024-01-26 23:54:03','俱詞也。从比从𪞶。','Y','2218','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('奭','9391',NULL,'大',NULL,NULL,NULL,NULL,NULL,'皕',NULL,NULL,NULL,NULL,'盛也。从大从皕，皕亦聲。此燕召公名。讀若郝。《史篇》名醜。','Y','2230',NULL,NULL);
INSERT INTO zn_zi_part VALUES('翟','2945',NULL,NULL,NULL,'羽','隹',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 01:16:30','山雉尾長者。从羽从隹。','Y','2236',NULL,NULL);
INSERT INTO zn_zi_part VALUES('翏','6803',NULL,NULL,NULL,'羽','㐱',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 01:17:34','高飛也。从羽从㐱。','Y','2252',NULL,NULL);
INSERT INTO zn_zi_part VALUES('雊','4036',NULL,NULL,NULL,NULL,'句',NULL,NULL,'隹',NULL,NULL,NULL,NULL,'雄雌鳴也。雷始動，雉鳴而雊其頸。从隹从句，句亦聲。','Y','2281',NULL,NULL);
INSERT INTO zn_zi_part VALUES('雈','4667',NULL,NULL,NULL,'𦫳',NULL,'隹',NULL,NULL,NULL,NULL,NULL,'2024-01-20 14:01:28','鴟屬。从隹从𦫳，有毛角。所鳴，其民有旤。凡雈之屬皆从雈。讀若和。','Y','2312',NULL,NULL);
INSERT INTO zn_zi_part VALUES('瞢','7257',NULL,'𥄕',NULL,NULL,NULL,NULL,NULL,'䀏',NULL,NULL,NULL,NULL,'目不明也。从𥄕从䀏。䀏，目數搖也。','Y','2320',NULL,NULL);
INSERT INTO zn_zi_part VALUES('美','241',NULL,NULL,NULL,'羊',NULL,'大',NULL,NULL,NULL,NULL,NULL,'2024-01-20 18:11:38','甘也。从羊从大。羊在六畜主給膳也。美與善同意。','Y','2346','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('羌','8451',NULL,'亻',NULL,NULL,'羊',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'西戎牧羊人也。从人从羊，羊亦聲。南方蠻閩从虫，北方狄从犬，東方貉从豸，西方羌从羊：此六種也。西南僰人、僬僥，从人；蓋在坤地，頗有順理之性。唯東夷从大。大，人也。夷俗仁，仁者壽，有君子不死之國。孔子曰：“道不行，欲之九夷，乘桴浮於海。”有以也。','Y','2347',NULL,NULL);
INSERT INTO zn_zi_part VALUES('瞿','8709','目',NULL,NULL,NULL,NULL,'隹','目',NULL,NULL,NULL,NULL,'2024-01-20 14:53:56','','Y','2351',NULL,NULL);
INSERT INTO zn_zi_part VALUES('幼','12217',NULL,'幺',NULL,NULL,NULL,NULL,NULL,'力',NULL,NULL,NULL,NULL,'少也。从幺从力。','Y','2489','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('惠','4783',NULL,NULL,NULL,'叀',NULL,'心',NULL,NULL,NULL,NULL,NULL,NULL,'仁也。从心从叀。','Y','2495','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('舒','9472',NULL,'舍',NULL,NULL,NULL,NULL,NULL,'予',NULL,NULL,NULL,NULL,'伸也。从舍从予，予亦聲。一曰舒，緩也。','Y','2501','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('敖','1356','土',NULL,'方',NULL,NULL,NULL,NULL,'攵',NULL,NULL,NULL,'2024-01-27 17:09:41','出游也。从出从放。','Y','2504',NULL,NULL);
INSERT INTO zn_zi_part VALUES('爰','12422',NULL,NULL,NULL,'爫','一','友',NULL,NULL,NULL,NULL,NULL,'2024-01-27 17:55:32','引也。从𠬪从于。籒文以爲車轅字。','Y','2507',NULL,NULL);
INSERT INTO zn_zi_part VALUES('死','9592',NULL,'夕',NULL,'一',NULL,NULL,NULL,'匕',NULL,NULL,NULL,'2024-01-15 13:23:27','澌也，人所離也。从歺从人。凡死之屬皆从死。','Y','2552','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('肘','13130',NULL,'月',NULL,NULL,'寸',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'臂節也。从肉从寸。寸，手寸口也。','Y','2619','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('胤','12057',NULL,'丿',NULL,'幺',NULL,' 月',NULL,'乚',NULL,NULL,NULL,'2024-01-17 01:34:46','子孫相承續也。从肉；从八，象其長也；从幺，象重累也。','Y','2635',NULL,NULL);
INSERT INTO zn_zi_part VALUES('隋','960',NULL,'阝',NULL,'',NULL,'','左',NULL,'月',NULL,NULL,'2025-02-08 16:59:27','裂肉也。从肉，从隓省。','Y','2660',NULL,NULL);
INSERT INTO zn_zi_part VALUES('腥','11178',NULL,'月',NULL,NULL,'星',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'星見食豕，令肉中生小息肉也。从肉从星，星亦聲。','Y','2694','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('肥','3513',NULL,'月',NULL,NULL,'巴',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-26 22:30:08','多肉也。从肉从卪。','Y','2723','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('腔','8453',NULL,'月',NULL,NULL,'空',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'内空也。从肉从空，空亦聲。','Y','2726','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('筋','5453',NULL,'月',NULL,'⺮',NULL,NULL,NULL,'力',NULL,NULL,NULL,'2024-01-17 01:25:41','肉之力也。从力从肉从竹。竹，物之多筋者。凡筋之屬皆从筋。','Y','2729','in HSK','muscle');
INSERT INTO zn_zi_part VALUES('初','2418',NULL,'衤',NULL,NULL,'刀',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-18 02:01:09','始也。从刀从衣。裁衣之始也。','Y','2742','in HSK','beginning');
INSERT INTO zn_zi_part VALUES('制','13019','⺧',NULL,'巾',NULL,'',NULL,NULL,'刂',NULL,NULL,NULL,'2025-02-08 17:00:06','裁也。从刀从未。未，物成有滋味，可裁斷。一曰止也。','Y','2784','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('刵','3398',NULL,'刀',NULL,NULL,NULL,NULL,NULL,'耳',NULL,NULL,NULL,NULL,'斷耳也。从刀从耳。','Y','2787',NULL,NULL);
INSERT INTO zn_zi_part VALUES('刺','2594',NULL,NULL,NULL,NULL,'朿',NULL,NULL,'刂',NULL,NULL,NULL,'2024-01-26 15:57:20','君殺大夫曰刺。刺，直傷也。从刀从朿，朿亦聲。','Y','2794','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('栔','8337',NULL,'㓞',NULL,NULL,NULL,NULL,NULL,'木',NULL,NULL,NULL,NULL,'刻也。从㓞从木。','Y','2805',NULL,NULL);
INSERT INTO zn_zi_part VALUES('等','2916',NULL,NULL,NULL,'⺮','寺',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'齊簡也。从竹从寺。寺，官曹之等平也。','Y','2884','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('筮','9411',NULL,NULL,NULL,'⺮','𢍮',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'《易》卦用蓍也。从竹从𢍮。𢍮，古文巫字。','Y','2888',NULL,NULL);
INSERT INTO zn_zi_part VALUES('簋','4212',NULL,NULL,NULL,'⺮','艮','皿',NULL,NULL,NULL,NULL,NULL,'2024-01-21 22:13:29','黍稷方器也。从竹从皿从皀。','Y','2927',NULL,NULL);
INSERT INTO zn_zi_part VALUES('簠','3726',NULL,NULL,NULL,'⺮','甫','皿',NULL,NULL,NULL,NULL,NULL,NULL,'黍稷圜器也。从竹从皿，甫聲。','Y','2928',NULL,NULL);
INSERT INTO zn_zi_part VALUES('筑','13216',NULL,NULL,NULL,'⺮','巩',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-27 17:57:35','以竹曲五弦之樂也。从竹从𢀜。𢀜，持之也。竹亦聲。','Y','2984','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('筭','9714',NULL,NULL,NULL,'⺮','弄',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'長六寸。計歷數者。从竹从弄。言常弄乃不誤也。','Y','2995',NULL,NULL);
INSERT INTO zn_zi_part VALUES('算','9715',NULL,NULL,NULL,'⺮','目','廾',NULL,NULL,NULL,NULL,NULL,'2024-01-25 01:58:12','數也。从竹从具。讀若筭。','Y','2996','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('差','186',NULL,NULL,NULL,'⺶','工','',NULL,NULL,NULL,NULL,NULL,'2025-03-06 22:26:24','貳也。差不相值也。从左从𠂹。','Y','3013','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('甛','10038',NULL,'甘',NULL,NULL,NULL,NULL,NULL,'舌',NULL,NULL,NULL,NULL,'美也。从甘从舌。舌，知甘者。','Y','3023',NULL,NULL);
INSERT INTO zn_zi_part VALUES('沓','2734',NULL,NULL,NULL,'水',NULL,'曰',NULL,NULL,NULL,NULL,NULL,'2024-01-18 01:43:06','語多沓沓也。从水从曰。遼東有沓縣。','Y','3032',NULL,NULL);
INSERT INTO zn_zi_part VALUES('甹','8131',NULL,'丂',NULL,NULL,NULL,NULL,NULL,'由',NULL,NULL,NULL,NULL,'亟詞也。从丂从由。或曰甹，俠也。三輔謂輕財者爲甹。','Y','3038',NULL,NULL);
INSERT INTO zn_zi_part VALUES('奇','4878',NULL,NULL,NULL,'大',NULL,'可',NULL,NULL,NULL,NULL,NULL,'2024-01-26 16:06:05','異也。一曰不耦。从大从可。','Y','3042','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('亏','6108',NULL,NULL,NULL,'一','丂',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-14 13:28:59','於也。象气之舒亏。从丂从一。一者，其气平之也。凡亏之屬皆从亏。(今變隸作于。)','Y','3052','in HSK','incomplete, loss');
INSERT INTO zn_zi_part VALUES('喜','10788',NULL,NULL,NULL,'吉','丷 一','口',NULL,NULL,NULL,NULL,NULL,'2024-01-27 17:52:26','樂也。从壴从口。凡喜之屬皆从喜。','Y','3059','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('憙','10793',NULL,NULL,NULL,'喜',NULL,'心',NULL,NULL,NULL,NULL,NULL,NULL,'說也。从心从喜，喜亦聲。','Y','3060',NULL,NULL);
INSERT INTO zn_zi_part VALUES('壴','13203',NULL,NULL,NULL,'十','豆',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-27 23:10:19','陳樂立而上見也。从屮从豆。凡壴之屬皆从壴。','Y','3062',NULL,NULL);
INSERT INTO zn_zi_part VALUES('尌','9497',NULL,'壴',NULL,NULL,NULL,NULL,NULL,'寸',NULL,NULL,NULL,NULL,'立也。从壴从寸，持之也。讀若駐。','Y','3063',NULL,NULL);
INSERT INTO zn_zi_part VALUES('豑','13062',NULL,'豊',NULL,NULL,NULL,NULL,NULL,'弟',NULL,NULL,NULL,NULL,'爵之次弟也。从豊从弟。《虞書》曰：“平豑東作。”','Y','3087',NULL,NULL);
INSERT INTO zn_zi_part VALUES('咅','8186',NULL,NULL,NULL,'立',NULL,'口',NULL,NULL,NULL,NULL,NULL,'2024-01-27 10:43:49','相與語，唾而不受也。从丶从否，否亦聲。','Y','3169',NULL,NULL);
INSERT INTO zn_zi_part VALUES('彤','10147',NULL,'丹',NULL,NULL,NULL,NULL,NULL,'彡',NULL,NULL,NULL,NULL,'丹飾也。从丹从彡。彡，其畫也。','Y','3172','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('阱','5532',NULL,'阝',NULL,NULL,'井',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'陷也。从𨸏从井，井亦聲。','Y','3177','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('合','4390',NULL,NULL,NULL,'人','一','口',NULL,NULL,NULL,NULL,NULL,'2024-01-15 13:09:01','合口也。从亼从口。','Y','3254','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('今','5445',NULL,NULL,NULL,'人','丶','乛',NULL,NULL,NULL,NULL,NULL,'2024-01-14 13:24:33','是時也。从亼从绁。绁，古文及。','Y','3257','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('仝','10139',NULL,'入',NULL,NULL,NULL,NULL,NULL,'工',NULL,NULL,NULL,NULL,'完也。从入从工。','Y','3268',NULL,NULL);
INSERT INTO zn_zi_part VALUES('矦','4511',NULL,'亻',NULL,NULL,'厂',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'春饗所䠶矦也。从人；从厂，象張布；矢在其下。天子䠶熊虎豹，服猛也；諸矦䠶熊豕虎；大夫射麋，麋，惑也；士射鹿豕，爲田除害也。其祝曰：“毋若不寕矦，不朝于王所，故伉而䠶汝也。”','Y','3296',NULL,NULL);
INSERT INTO zn_zi_part VALUES('知','12957',NULL,'矢',NULL,NULL,NULL,NULL,NULL,'口',NULL,NULL,NULL,'2024-01-18 20:57:13','詞也。从口从矢。','Y','3300','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('市','9393',NULL,NULL,NULL,'亠','巾',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-15 12:14:17','買賣所之也。市有垣，从冂从绁，绁，古文及，象物相及也。之省聲。','Y','3308','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('就','138',NULL,'京',NULL,NULL,NULL,NULL,NULL,'尤',NULL,NULL,NULL,NULL,'就，高也。从京从尤。尤，異於凡也。','Y','3315','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('厚','4520','厂',NULL,NULL,NULL,'日','子',NULL,NULL,NULL,NULL,NULL,'2024-01-26 23:48:47','山陵之厚也。从𣆪从厂。','Y','3322','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('夌','6722',NULL,NULL,NULL,'土','八','夂',NULL,NULL,NULL,NULL,NULL,'2024-01-27 10:36:10','越也。从夊从𡴆。𡴆，高也。一曰夌约也。','Y','3349',NULL,NULL);
INSERT INTO zn_zi_part VALUES('致','13054',NULL,'夊',NULL,NULL,NULL,NULL,NULL,'至',NULL,NULL,NULL,NULL,'送詣也。从夊从至。','Y','3350','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('夏','10875',NULL,NULL,NULL,'頁',NULL,'夂',NULL,NULL,NULL,NULL,NULL,'2024-01-20 22:49:05','中國之人也。从夊从頁从𦥑。𦥑，兩手；夊，兩足也。','Y','3356','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('某','7502',NULL,NULL,NULL,'甘',NULL,'木',NULL,NULL,NULL,NULL,NULL,'2024-01-18 16:41:47','酸果也。从木从甘。闕。','Y','3541','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('枚','7182',NULL,'木',NULL,NULL,'攵',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-27 23:54:42','榦也。可爲杖。从木从攴。《詩》曰：“施于條枚。”','Y','3557','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('枓','3153',NULL,'木',NULL,NULL,'斗',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'勺也。从木从斗。','Y','3693',NULL,NULL);
INSERT INTO zn_zi_part VALUES('杓','1760',NULL,'木',NULL,NULL,'勺',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'枓柄也。从木从勺。','Y','3694',NULL,NULL);
INSERT INTO zn_zi_part VALUES('臬','7730',NULL,NULL,NULL,'自',NULL,'木',NULL,NULL,NULL,NULL,NULL,'2024-01-18 16:42:14','射凖的也。从木从自。李陽冰曰：“自非聲，从劓省。”','Y','3742',NULL,NULL);
INSERT INTO zn_zi_part VALUES('采','1952',NULL,NULL,NULL,'爪',NULL,'木',NULL,NULL,NULL,NULL,NULL,'2024-01-18 16:42:41','捋取也。从木从爪。','Y','3775','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('枰','8144',NULL,'木',NULL,NULL,'平',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'平也。从木从平，平亦聲。','Y','3786',NULL,NULL);
INSERT INTO zn_zi_part VALUES('析','10713',NULL,'木',NULL,NULL,'斤',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'破木也。一曰折也。从木从斤。','Y','3791','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('杽','2410',NULL,'木',NULL,NULL,'手',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'械也。从木从手，手亦聲。','Y','3802',NULL,NULL);
INSERT INTO zn_zi_part VALUES('柬','5163',NULL,'',NULL,NULL,'束',NULL,NULL,'',NULL,NULL,'八','2025-02-23 14:52:31','分別𥳑之也。从束从八。八，分別也。','Y','3882','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('剌','6189',NULL,NULL,NULL,NULL,'束',NULL,NULL,'刂',NULL,NULL,NULL,'2024-01-27 17:34:44','戾也。从束从刀。刀者，剌之也。','Y','3884',NULL,NULL);
INSERT INTO zn_zi_part VALUES('鄯','9159',NULL,NULL,NULL,NULL,'善',NULL,NULL,'阝',NULL,NULL,NULL,NULL,'鄯善，西胡國也。从邑从善，善亦聲。','Y','3998',NULL,NULL);
INSERT INTO zn_zi_part VALUES('敫','5311','白',NULL,'方',NULL,NULL,NULL,NULL,'攵',NULL,NULL,NULL,'2024-01-23 22:23:08','光景流也。从白从放。讀若龠。','Y','2505',NULL,NULL);
INSERT INTO zn_zi_part VALUES('昌','2140',NULL,NULL,NULL,'日',NULL,'日',NULL,NULL,NULL,NULL,NULL,'2025-04-11 16:24:17','美言也。从日从曰。一曰日光也。《詩》曰：“東方昌矣。”','Y','4218','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('普','8210',NULL,NULL,NULL,'並',NULL,'日',NULL,NULL,NULL,NULL,NULL,'2024-01-19 18:45:10','日無色也。从日从並。','Y','4237','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('旋','11358',NULL,'方',NULL,NULL,NULL,NULL,'丿 一','','疋',NULL,NULL,'2025-04-02 23:25:12','周旋，旌旗之指麾也。从㫃从疋。疋，足也。','Y','4279','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('冥','7419',NULL,NULL,NULL,'冖','日','六',NULL,NULL,NULL,NULL,NULL,'2024-01-20 03:03:54','幽也。从日从六， 冖聲。日數十。十六日而月始虧幽也。凡冥之屬皆从冥。','Y','4284',NULL,NULL);
INSERT INTO zn_zi_part VALUES('朙','7423',NULL,NULL,NULL,NULL,'囧',NULL,NULL,'月',NULL,NULL,NULL,'2024-01-20 04:45:56','照也。从月从囧。凡朙之屬皆从朙。','Y','4304',NULL,NULL);
INSERT INTO zn_zi_part VALUES('夗','12444',NULL,'夕',NULL,NULL,NULL,NULL,NULL,'㔾',NULL,NULL,NULL,'2024-01-20 05:23:22','轉臥也。从夕从卪。臥有卪也。','Y','4311',NULL,NULL);
INSERT INTO zn_zi_part VALUES('禾','4401',NULL,NULL,NULL,'丿','木',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-14 15:23:01','嘉穀也。二月始生，八月而孰，得時之中，故謂之禾。禾，木也。木王而生，金王而死。从木，从𠂹省。𠂹象其穗。凡禾之屬皆从禾。','Y','4353','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('科','5936',NULL,'禾',NULL,NULL,'斗',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'程也。从禾从斗。斗者，量也。','Y','4433','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('香','10990',NULL,NULL,NULL,'禾',NULL,'日',NULL,NULL,NULL,NULL,NULL,'2024-01-27 00:26:44','芳也。从黍从甘。《春秋傳》曰：“黍稷馨香。”凡香之屬皆从香。','Y','4452','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('麻','7047',NULL,NULL,NULL,'广','林',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-25 21:59:52','與𣏟同。人所治，在屋下。从广从𣏟。凡麻之屬皆从麻。','Y','4512','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('室','9392',NULL,NULL,NULL,'宀','至',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'實也。从宀从至。至，所止也。','Y','4537','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('向','11008',NULL,NULL,NULL,'','',NULL,NULL,NULL,NULL,NULL,'','2025-02-08 16:47:29','北出牖也。从宀从口。《詩》曰：“塞向墐戶。”','Y','4539','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('定','3111',NULL,NULL,NULL,'宀','正',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'安也。从宀从正。','Y','4555','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('宦','4674',NULL,NULL,NULL,'宀','臣',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'仕也。从宀从臣。','Y','4573','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('宰','111',NULL,NULL,NULL,'宀','辛',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-18 01:38:48','辠人在屋下執事者。从宀从辛。辛，辠也。','Y','4574','in HSK','slaughter');
INSERT INTO zn_zi_part VALUES('守','9433',NULL,NULL,NULL,'宀','寸',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-16 23:54:33','守官也。从宀从寸。寺府之事者。从寸。寸，法度也。','Y','4575','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('寡','4114',NULL,NULL,NULL,'宀','页','分',NULL,NULL,NULL,NULL,NULL,'2024-01-25 08:37:27','少也。从宀从頒。頒，分賦也，故爲少。','Y','4587','in HSK','few / less');
INSERT INTO zn_zi_part VALUES('害','4280',NULL,NULL,NULL,'宀','丰','口',NULL,NULL,NULL,NULL,NULL,'2024-01-27 10:11:08','傷也。从宀从口。宀、口，言从家起也。丯聲。','Y','4594','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('宋','949',NULL,NULL,NULL,'宀','木',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-18 01:30:26','居也。从宀从木。讀若送。','Y','4600','in HSK','surname');
INSERT INTO zn_zi_part VALUES('宗','13404',NULL,NULL,NULL,'宀','示',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'尊祖廟也。从宀从示。','Y','4602','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('窞','2830',NULL,NULL,NULL,'穴',NULL,'臽',NULL,NULL,NULL,NULL,NULL,NULL,'坎中小坎也。从穴从臽，臽亦聲。《易》曰：“入于坎窞。”一曰㫄入也。','Y','4634',NULL,NULL);
INSERT INTO zn_zi_part VALUES('瘚','5780','疒',NULL,NULL,NULL,'欮',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 12:30:31','屰气也。从疒从屰从欠。','Y','4712',NULL,NULL);
INSERT INTO zn_zi_part VALUES('疢','2231','疒',NULL,NULL,NULL,'火',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'熱病也。从疒从火。','Y','4749',NULL,NULL);
INSERT INTO zn_zi_part VALUES('冠','4132',NULL,'元',NULL,'冖',NULL,NULL,NULL,'寸',NULL,NULL,NULL,'2024-01-27 00:56:48','絭也。所以絭髮，弁冕之緫名也。从冂从元，元亦聲。冠有法制，从寸。','Y','4776','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('冣','5684',NULL,'冂',NULL,NULL,NULL,NULL,NULL,'取',NULL,NULL,NULL,NULL,'積也。从冂从取，取亦聲。','Y','4777',NULL,NULL);
INSERT INTO zn_zi_part VALUES('同','10142',NULL,NULL,NULL,NULL,'冂',NULL,NULL,NULL,NULL,NULL,'一 口','2024-01-15 13:24:40','合會也。从𠔼从口。','Y','4780','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('冒','7154',NULL,NULL,NULL,'冃',NULL,'目',NULL,NULL,NULL,NULL,NULL,'2024-01-27 00:05:05','冡而前也。从冃从目。','Y','4786','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('最','13478',NULL,NULL,NULL,'日',NULL,'取',NULL,NULL,NULL,NULL,NULL,'2024-01-25 01:59:15','犯而取也。从冃从取。','Y','4787','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('詈','6513',NULL,NULL,NULL,'罒','言',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 09:05:41','罵也。从网从言。网辠人。','Y','4822',NULL,NULL);
INSERT INTO zn_zi_part VALUES('飾','13956',NULL,'饣',NULL,NULL,NULL,NULL,'人',NULL,'巾',NULL,NULL,'2024-01-21 11:35:58','㕞也。从巾从人，食聲。讀若式。一曰襐飾。','Y','4876',NULL,NULL);
INSERT INTO zn_zi_part VALUES('保','53',NULL,'亻',NULL,NULL,'呆',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-25 01:40:42','養也。从人，从𤓽省。𤓽，古文孚。','Y','4928','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('仁','8849',NULL,'亻',NULL,NULL,'二',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-14 14:35:16','親也。从人从二。','Y','4929','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('仕','9383',NULL,'亻',NULL,NULL,'士',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'學也。从人从士。','Y','4932',NULL,NULL);
INSERT INTO zn_zi_part VALUES('佼','5302',NULL,'亻',NULL,NULL,'交',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'交也。从人从交。','Y','4933',NULL,NULL);
INSERT INTO zn_zi_part VALUES('佩','7953',NULL,'亻',NULL,NULL,'凡',NULL,NULL,'',NULL,NULL,'巾','2025-02-16 08:20:45','大帶佩也。从人从凡从巾。佩必有巾，巾謂之飾。','Y','4936','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('仲','13102',NULL,'亻',NULL,NULL,'中',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'中也。从人从中，中亦聲。','Y','4944','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('伊','11790',NULL,'亻',NULL,NULL,'尹',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'殷聖人阿衡，尹治天下者。从人从尹。','Y','4945','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('偫','13018',NULL,'亻',NULL,NULL,'待',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'待也。从人从待。','Y','5004',NULL,NULL);
INSERT INTO zn_zi_part VALUES('仰','11664',NULL,'亻',NULL,NULL,'卬',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-15 13:37:41','舉也。从人从卬。','Y','5039','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('伍','10630',NULL,'亻',NULL,NULL,'五',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-15 13:27:20','相參伍也。从人从五。','Y','5044','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('作','13499',NULL,'亻',NULL,NULL,'乍',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'起也。从人从乍。','Y','5051','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('倌','4131',NULL,'亻',NULL,NULL,'官',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'小臣也。从人从官。《詩》曰：“命彼倌人。”','Y','5081',NULL,NULL);
INSERT INTO zn_zi_part VALUES('伏','3655',NULL,'亻',NULL,NULL,'犬',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-15 13:04:53','司也。从人从犬。','Y','5138','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('咎','5609','久',NULL,NULL,NULL,NULL,'口','人',NULL,NULL,NULL,NULL,'2024-01-20 03:15:57','災也。从人从各。各者，相違也。','Y','5150',NULL,NULL);
INSERT INTO zn_zi_part VALUES('像','11006',NULL,'亻',NULL,NULL,'象',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'象也。从人从象，象亦聲。讀若養。','Y','5157','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('件','5188',NULL,'亻',NULL,NULL,'牛',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-15 13:11:54','分也。从人从牛。牛大物，故可分。','Y','5170','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('倜','10006',NULL,'亻',NULL,NULL,'周',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'倜儻，不羈也。从人从周。未詳。','Y','5175',NULL,NULL);
INSERT INTO zn_zi_part VALUES('眞','12864',NULL,NULL,NULL,'匕 ',' 目','八',NULL,NULL,NULL,NULL,NULL,'2024-01-19 00:04:30','僊人變形而登天也。从𠤎从目从乚；(音隱。)八，所乘載也。','Y','5191','incomplete',NULL);
INSERT INTO zn_zi_part VALUES('比','1633',NULL,'匕',NULL,NULL,NULL,NULL,NULL,'匕 ',NULL,NULL,NULL,'2024-01-14 12:49:29','密也。二人爲从，反从爲比。凡比之屬皆从比。','Y','5205','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('殷','11511',NULL,'㐆',NULL,NULL,NULL,NULL,NULL,'殳',NULL,NULL,NULL,NULL,'作樂之盛稱殷。从㐆从殳。《易》曰：“殷薦之上帝。”','Y','5229','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('衵','7673',NULL,'衤',NULL,NULL,'日',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'日日所常衣。从衣从日，日亦聲。','Y','5302',NULL,NULL);
INSERT INTO zn_zi_part VALUES('尿','7710',NULL,NULL,NULL,'尸','水',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-23 22:45:20','人小便也。从尾从水。','Y','5405','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('履','6943',NULL,NULL,NULL,'尸','復',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 15:13:46','足所依也。从尸从彳从夊，舟象履形。一曰尸聲。凡履之屬皆从履。','Y','5406','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('俞','12234',NULL,NULL,'月','人','一',NULL,NULL,NULL,'刂',NULL,NULL,'2024-01-21 22:08:02','空中木爲舟也。从亼从舟从巜。巜，水也。','Y','5413',NULL,NULL);
INSERT INTO zn_zi_part VALUES('般','1458',NULL,'舟',NULL,NULL,'',NULL,NULL,'殳',NULL,NULL,NULL,'2025-02-16 12:49:36','辟也。象舟之旋，从舟。从殳，殳，所以旋也。','Y','5422','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('兄','11210',NULL,NULL,NULL,'口',NULL,'儿',NULL,NULL,NULL,NULL,NULL,'2024-01-15 12:29:33','長也。从儿从口。凡兄之屬皆从兄。','Y','5436','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('兜','3146','匚','',NULL,'白','','儿','㇆ 一','',NULL,NULL,NULL,'2025-02-16 17:09:48','兜鍪，首鎧也。从𠑹，从皃省。皃象人頭也。','Y','5443','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('髟','1779',NULL,'長',NULL,NULL,NULL,NULL,NULL,'彡',NULL,NULL,NULL,NULL,'長髮猋猋也。从長从彡。凡髟之屬皆从髟。','Y','5699',NULL,NULL);
INSERT INTO zn_zi_part VALUES('髦','7140',NULL,NULL,NULL,'髟',NULL,'毛',NULL,NULL,NULL,NULL,NULL,NULL,'髮也。从髟从毛。','Y','5706',NULL,NULL);
INSERT INTO zn_zi_part VALUES('色','9073',NULL,NULL,NULL,'刀','巴',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-17 01:13:50','顔气也。从人从卪。凡色之屬皆从色。','Y','5763','in HSK','color');
INSERT INTO zn_zi_part VALUES('辟','1700','尸',NULL,'口',NULL,NULL,NULL,NULL,'辛',NULL,NULL,NULL,'2024-01-27 21:29:49','法也。从卩从辛，節制其辠也；从口，用法者也。凡辟之屬皆从辟。','Y','5768','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('胞','1510',NULL,'月',NULL,NULL,'包',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'兒生裹也。从肉从包。','Y','5787','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('匏','7924',NULL,'包',NULL,NULL,NULL,NULL,NULL,'夸',NULL,NULL,NULL,NULL,'瓠也。从包，从夸聲。包，取其可包藏物也。','Y','5788',NULL,NULL);
INSERT INTO zn_zi_part VALUES('魑','2305',NULL,'鬼',NULL,NULL,'离',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'鬼屬。从鬼从离，离亦聲。','Y','5808',NULL,NULL);
INSERT INTO zn_zi_part VALUES('禺','7842',NULL,NULL,NULL,'甲',NULL,'禸',NULL,NULL,NULL,NULL,NULL,'2024-12-31 21:51:46','母猴屬。頭似鬼。从甶从禸。','Y','5813',NULL,NULL);
INSERT INTO zn_zi_part VALUES('嶞','3286',NULL,NULL,NULL,NULL,'憜','山',NULL,NULL,NULL,NULL,NULL,NULL,'山之墮墮者。从山，从憜省聲。讀若相推落之憜。','Y','5847',NULL,NULL);
INSERT INTO zn_zi_part VALUES('嵩','9625',NULL,NULL,NULL,'山','高',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 04:59:42','中岳，嵩高山也。从山从高，亦从松。韋昭《國語》注云：“古通用崇字。”','Y','5880',NULL,NULL);
INSERT INTO zn_zi_part VALUES('耏','3378',NULL,'而',NULL,NULL,NULL,NULL,NULL,'彡',NULL,NULL,NULL,NULL,'罪不至髡也。从而从彡。','Y','6046',NULL,NULL);
INSERT INTO zn_zi_part VALUES('麀','12178',NULL,NULL,NULL,'鹿','匕',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 20:50:42','牝鹿也。从鹿，从牝省。','Y','6255',NULL,NULL);
INSERT INTO zn_zi_part VALUES('冤','12393',NULL,NULL,NULL,'冖','兔','',NULL,NULL,NULL,NULL,NULL,'2025-03-09 18:47:53','屈也。从兔从冂。兔在冂下，不得走，益屈折也。','Y','6264','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('尨','7111',NULL,NULL,NULL,NULL,'犬',NULL,NULL,'彡',NULL,NULL,NULL,'2024-01-20 13:02:46','犬之多毛者。从犬从彡。《詩》曰：“無使尨也吠。”','Y','6272',NULL,NULL);
INSERT INTO zn_zi_part VALUES('臭','2415',NULL,NULL,NULL,'自',NULL,'犬',NULL,NULL,NULL,NULL,NULL,'2024-01-20 13:03:35','禽走，臭而知其迹者，犬也。从犬从自。','Y','6329','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('灰','273','又',NULL,NULL,NULL,' 火',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-15 12:52:10','死火餘㶳也。从火从又。又，手也。火旣滅，可以執持。','Y','6416','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('奄','11506',NULL,NULL,NULL,'大','电',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-27 11:06:14','覆也。大有餘也。又，欠也。从大从申。申，展也。','Y','6567','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('夷','11820',NULL,'大',NULL,NULL,NULL,NULL,NULL,'弓',NULL,NULL,NULL,NULL,'平也。从大从弓。東方之人也。','Y','6581','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('懿','8',NULL,'壹',NULL,NULL,NULL,NULL,NULL,'恣',NULL,NULL,NULL,NULL,'專久而美也。从壹，从恣省聲。','Y','6610',NULL,NULL);
INSERT INTO zn_zi_part VALUES('皋','3866',NULL,'𠦍',NULL,NULL,NULL,NULL,NULL,'白',NULL,NULL,NULL,NULL,'气皐白之進也。从𠦍从白。《禮》：祝曰臯，登謌曰奏。故臯奏皆从夲。《周禮》曰：“詔來鼓皐舞。”皐，告之也。','Y','6627',NULL,NULL);
INSERT INTO zn_zi_part VALUES('奡','1375',NULL,'',NULL,'一','自','夰',NULL,'',NULL,NULL,NULL,'2025-04-28 07:35:05','嫚也。从𦣻从夰，夰亦聲。《虞書》曰：“若丹朱奡。”讀若傲。《論語》：“奡湯舟。”','Y','6630',NULL,NULL);
INSERT INTO zn_zi_part VALUES('奘','12582',NULL,'亣',NULL,NULL,NULL,NULL,NULL,'壯',NULL,NULL,NULL,NULL,'駔大也。从亣从壯，壯亦聲。','Y','6635',NULL,NULL);
INSERT INTO zn_zi_part VALUES('竦','9638',NULL,'立',NULL,NULL,'束',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'敬也。从立从束。束，自申束也。','Y','6649',NULL,NULL);
INSERT INTO zn_zi_part VALUES('息','10703',NULL,NULL,NULL,'自',NULL,'心',NULL,NULL,NULL,NULL,NULL,NULL,'喘也。从心从自，自亦聲。','Y','6671','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('意','11910',NULL,NULL,NULL,'音',NULL,'心',NULL,NULL,NULL,NULL,NULL,NULL,'志也。从心察言而知意也。从心从音。','Y','6675','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('忘','10406',NULL,NULL,NULL,'亡',NULL,'心',NULL,NULL,NULL,NULL,NULL,NULL,'不識也。从心从亡，亡亦聲。','Y','6810','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('衍','11588',NULL,NULL,NULL,NULL,'行',NULL,NULL,NULL,NULL,NULL,'氵','2024-01-18 01:43:46','水朝宗于海也。从水从行。','Y','7101','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('汭','8975',NULL,'氵',NULL,NULL,'内',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'水相入也。从水从内，内亦聲。','Y','7109',NULL,NULL);
INSERT INTO zn_zi_part VALUES('洸','4176',NULL,'氵',NULL,NULL,'光',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'水涌光也。从水从光，光亦聲。《詩》曰：“有洸有潰。”','Y','7137',NULL,NULL);
INSERT INTO zn_zi_part VALUES('沙','9084',NULL,'氵',NULL,NULL,'少',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'水𢿱石也。从水从少。水少沙見。楚東有沙水。','Y','7201','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('派','7872',NULL,'氵',NULL,NULL,'𠂢',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'別水也。从水从𠂢，𠂢亦聲。','Y','7212','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('洄','4761',NULL,'氵',NULL,NULL,'回',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'㴑洄也。从水从回。','Y','7249',NULL,NULL);
INSERT INTO zn_zi_part VALUES('砅','6498',NULL,'石',NULL,NULL,'水',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-18 01:44:45','履石渡水也。从水从石。《詩》曰：“深則砅。”','Y','7255',NULL,NULL);
INSERT INTO zn_zi_part VALUES('泐','6334',NULL,'氵',NULL,NULL,'阞',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'水石之理也。从水从阞。《周禮》曰：“石有時而泐。”','Y','7297',NULL,NULL);
INSERT INTO zn_zi_part VALUES('汲','4942',NULL,'氵',NULL,NULL,'及',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'引水於井也。从水从及，及亦聲。','Y','7378',NULL,NULL);
INSERT INTO zn_zi_part VALUES('泮','7896',NULL,'氵',NULL,NULL,'半',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'諸矦鄉射之宮，西南爲水，東北爲牆。从水从半，半亦聲。','Y','7406',NULL,NULL);
INSERT INTO zn_zi_part VALUES('邕','12137',NULL,NULL,NULL,'巛',NULL,'邑',NULL,NULL,NULL,NULL,NULL,'2024-01-23 22:08:21','四方有水，自邕城池者。从川从邑。','Y','7449',NULL,NULL);
INSERT INTO zn_zi_part VALUES('冰','1818',NULL,'冫',NULL,NULL,'水',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-15 12:53:24','水堅也。从仌从水。','Y','7471','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('冬','3124',NULL,NULL,NULL,'夂',NULL,'冫',NULL,NULL,NULL,NULL,NULL,'2024-01-14 15:18:10','四時盡也。从仌从夂。夂，古文終字。','Y','7478','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('孔','6001',NULL,'子',NULL,NULL,NULL,NULL,NULL,'乚',NULL,NULL,NULL,'2024-11-30 22:00:27','','Y','7664','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('乳','8941',NULL,'孚',NULL,NULL,NULL,NULL,NULL,'乙',NULL,NULL,NULL,'2024-01-26 22:50:27','人及鳥生子曰乳，獸曰産。从孚从𠃉。𠃉者，玄鳥也。《明堂月令》：“玄鳥至之日，祠于高禖，以請子。”故乳从𠃉。請子必以𠃉至之日者，𠃉，春分來，秋分去，開生之候鳥，帝少昊司分之官也。','Y','7665','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('否','3632',NULL,NULL,NULL,'不',NULL,'口',NULL,NULL,NULL,NULL,NULL,'2024-01-16 23:03:28','不也。从口从不，不亦聲。','Y','7667','in HSK','negate, decline');
INSERT INTO zn_zi_part VALUES('扇','9119',NULL,NULL,NULL,'户','羽',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 01:36:14','扉也。从戶，从翄聲。','Y','7684','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('閒','5229',NULL,'門',NULL,NULL,NULL,NULL,NULL,'月',NULL,NULL,NULL,NULL,'隟也。从門从月。','Y','7722',NULL,NULL);
INSERT INTO zn_zi_part VALUES('插','2038',NULL,'扌',NULL,NULL,'臿',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'刺肉也。从手从臿。','Y','7857','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('授','79',NULL,'扌',NULL,NULL,'受',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'予也。从手从受，受亦聲。','Y','7873','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('承','2265',NULL,NULL,NULL,NULL,'氶',NULL,NULL,NULL,NULL,NULL,'三','2024-01-26 16:56:38','奉也。受也。从手从卪从𠬞。','Y','7874','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('投','10180',NULL,'扌',NULL,NULL,'',NULL,NULL,'殳',NULL,NULL,NULL,'2025-02-16 12:52:39','擿也。从手从殳。','Y','7887','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('脊','299','','',NULL,'北','','月','','',NULL,NULL,NULL,'2025-02-16 08:29:29','背呂也。从𠦬从肉。','Y','8068','in HSK','rib');
INSERT INTO zn_zi_part VALUES('姓','11197',NULL,'女',NULL,NULL,'生',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'人所生也。古之神聖母，感天而生子，故稱天子。从女从生，生亦聲。《春秋傳》曰：“天子因生以賜姓。”','Y','8070','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('婚','4808',NULL,'女',NULL,NULL,'昏',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'婦家也。《禮》：娶婦以昏時，婦人陰也，故曰婚。从女从昏，昏亦聲。','Y','8087','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('姻','11990',NULL,'女',NULL,NULL,'因',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'壻家也。女之所因，故曰姻。从女从因，因亦聲。','Y','8088','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('妊','8861',NULL,'女',NULL,NULL,'壬',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'孕也。从女从壬，壬亦聲。','Y','8093',NULL,NULL);
INSERT INTO zn_zi_part VALUES('威','10415',NULL,NULL,NULL,NULL,'戌',NULL,NULL,NULL,NULL,NULL,'女','2024-01-27 00:22:22','姑也。从女从戌。漢律曰：“婦告威姑。”','Y','8105','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('娣','2975',NULL,'女',NULL,NULL,'弟',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'女弟也。从女从弟，弟亦聲。','Y','8109',NULL,NULL);
INSERT INTO zn_zi_part VALUES('奴','7786',NULL,'女',NULL,NULL,'又',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'奴、婢，皆古之辠人也。《周禮》曰：“其奴，男子入于辠隸，女子入于舂藁。”从女从又。','Y','8121','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('媄','7208',NULL,'女',NULL,NULL,'美',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'色好也。从女从美，美亦聲。','Y','8145',NULL,NULL);
INSERT INTO zn_zi_part VALUES('委','10414',NULL,NULL,NULL,'禾',NULL,'女',NULL,NULL,NULL,NULL,NULL,'2024-01-18 21:22:58','委隨也。从女从禾。','Y','8173','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('如','8925',NULL,'女',NULL,NULL,'口',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'从隨也。从女从口。','Y','8203','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('媛','12416',NULL,'女',NULL,NULL,'爰',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'美女也。人所援也。从女从爰。爰，引也。《詩》曰：“邦之媛兮。”','Y','8221',NULL,NULL);
INSERT INTO zn_zi_part VALUES('奸','5114',NULL,'女',NULL,NULL,'干',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-16 23:11:35','犯婬也。从女从干，干亦聲。','Y','8298','in HSK','rape');
INSERT INTO zn_zi_part VALUES('毐','13522',NULL,'士',NULL,NULL,NULL,NULL,NULL,'毋',NULL,NULL,NULL,NULL,'人無行也。从士从毋。賈侍中說：秦始皇母與嫪毐淫，坐誅，故世罵淫曰嫪毐。讀若娭。','Y','8315',NULL,NULL);
INSERT INTO zn_zi_part VALUES('戛','5076',NULL,NULL,NULL,'𦣻',NULL,'戈',NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:56:54','𢧢也。从戈从𦣻。讀若棘。','Y','8338',NULL,NULL);
INSERT INTO zn_zi_part VALUES('或','4851',NULL,NULL,NULL,NULL,'口一',NULL,NULL,'戈',NULL,NULL,NULL,'2024-01-27 11:12:56','邦也。从囗从戈，以守一。一，地也。','Y','8344','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('戠','12979',NULL,NULL,NULL,NULL,'音',NULL,NULL,'戈',NULL,NULL,NULL,NULL,'闕。从戈从音。','Y','8356',NULL,NULL);
INSERT INTO zn_zi_part VALUES('我','212','丿','','扌',NULL,NULL,NULL,NULL,'戈',NULL,NULL,NULL,'2025-02-08 17:02:09','施身自謂也。或說我，頃頓也。从戈从𠄒。𠄒，或說古垂字。一曰古殺字。凡我之屬皆从我。','Y','8360','in HSK','I / self / me');
INSERT INTO zn_zi_part VALUES('直','12985',NULL,NULL,NULL,'十',NULL,'目',NULL,NULL,NULL,NULL,NULL,'2024-01-26 16:41:00','正見也。从𠃊从十从目。','Y','8369','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('医','11811',NULL,NULL,NULL,NULL,'匸',NULL,NULL,NULL,NULL,NULL,'矢','2024-01-17 00:09:49','盛弓弩矢器也。从匸从矢。《國語》曰：“兵不解医。”','Y','8380','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('弛','2311',NULL,'弓',NULL,NULL,'也',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'弓解也。从弓从也。','Y','8454','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('螟','7431',NULL,'虫',NULL,NULL,NULL,NULL,NULL,'冥',NULL,NULL,NULL,NULL,'蟲食穀葉者。吏冥冥犯法卽生螟。从虫从冥，冥亦聲。','Y','8763','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('鼂','2191',NULL,'黽',NULL,NULL,NULL,NULL,NULL,'旦',NULL,NULL,NULL,NULL,'匽鼂也。讀若朝。楊雄說：匽鼂，蟲名。杜林以爲朝旦，非是。从黽从旦。','Y','8964',NULL,NULL);
INSERT INTO zn_zi_part VALUES('亟','4921','口','',NULL,'了','','一','又','',NULL,NULL,NULL,'2025-02-16 17:09:21','敏疾也。从人从口，从又从二。二，天地也。','Y','8969',NULL,NULL);
INSERT INTO zn_zi_part VALUES('恒','4452',NULL,'忄',NULL,NULL,'亘',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-18 17:15:46','常也。从心从舟，在二之閒上下。心以舟施，恆也。','Y','8970','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('亘','3951',NULL,NULL,NULL,'一','日','一',NULL,NULL,NULL,NULL,NULL,'2024-01-28 13:14:18','求亘也。从二从囘。囘，古文回，象亘回形。上下，所求物也。','Y','8971',NULL,NULL);
INSERT INTO zn_zi_part VALUES('坪','8135',NULL,'土',NULL,NULL,NULL,NULL,NULL,'平',NULL,NULL,NULL,NULL,'地平也。从土从平，平亦聲。','Y','8982','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('均','5809',NULL,'土',NULL,NULL,'匀',NULL,NULL,NULL,NULL,NULL,NULL,'2024-02-10 17:42:11','平徧也。从土从勻，勻亦聲。','Y','8983','in HSK','even');
INSERT INTO zn_zi_part VALUES('坐','13513','人',NULL,NULL,NULL,'','土','人',NULL,NULL,NULL,NULL,'2025-02-08 17:02:36','止也。从土，从畱省。土，所止也。此與畱同意。','Y','9022','in HSK','sit');
INSERT INTO zn_zi_part VALUES('封','3591',NULL,'圭',NULL,NULL,NULL,NULL,NULL,'寸',NULL,NULL,NULL,'2024-01-18 22:09:20','爵諸矦之土也。从之从土从寸，守其制度也。公侯，百里；伯，七十里；子男，五十里。','Y','9029','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('墨','7461',NULL,NULL,NULL,'黑',NULL,'土',NULL,NULL,NULL,NULL,NULL,'2024-01-18 22:09:45','書墨也。从土从黑，黑亦聲。','Y','9031','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('城','2259',NULL,'土',NULL,NULL,NULL,NULL,NULL,'成',NULL,NULL,NULL,NULL,'以盛民也。从土从成，成亦聲。','Y','9036','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('塞','9010',NULL,NULL,NULL,'宀','井大','土',NULL,NULL,NULL,NULL,NULL,'2024-01-27 21:58:18','隔也。从土从𡨄。','Y','9048','in HSK, incomplete',NULL);
INSERT INTO zn_zi_part VALUES('圣','9322',NULL,NULL,NULL,'又',NULL,'土',NULL,NULL,NULL,NULL,NULL,'2024-01-15 12:13:07','汝潁之閒謂致力於地曰圣。从土从又。讀若兔窟。','Y','9049','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('里','6443',NULL,NULL,NULL,'田',NULL,'土',NULL,NULL,NULL,NULL,NULL,'2024-01-16 23:26:42','居也。从田从土。凡里之屬皆从里。','Y','9122','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('男','7580',NULL,NULL,NULL,'田',NULL,'力',NULL,NULL,NULL,NULL,NULL,'2024-01-16 23:40:58','丈夫也。从田从力。言男用力於田也。凡男之屬皆从男。','Y','9162','in HSK','male / man');
INSERT INTO zn_zi_part VALUES('功','3977',NULL,'工',NULL,NULL,NULL,NULL,NULL,'力',NULL,NULL,NULL,'2024-01-14 15:21:19','以勞定國也。从力从工，工亦聲。','Y','9167','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('加','5050',NULL,'力',NULL,NULL,'口',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 18:32:29','語相增加也。从力从口。','Y','9196','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('凭','8143',NULL,NULL,NULL,'任',NULL,'几',NULL,NULL,NULL,NULL,NULL,'2024-01-26 16:25:08','依几也。从几从任。《周書》：“凭玉几。”讀若馮。','Y','9421','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('処','2441',NULL,'几',NULL,NULL,NULL,NULL,NULL,'夂',NULL,NULL,NULL,NULL,'止也。得几而止。从几从夂。','Y','9423',NULL,NULL);
INSERT INTO zn_zi_part VALUES('斝','5094','口',NULL,NULL,NULL,'冖','斗','口',NULL,NULL,NULL,NULL,'2024-01-21 22:27:24','玉爵也。夏曰琖，殷曰斝，周曰爵。从吅从斗，冂象形。與爵同意。或說斝受六斗。','Y','9444',NULL,NULL);
INSERT INTO zn_zi_part VALUES('陟','13075',NULL,'阝',NULL,NULL,'步',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'登也。从𨸏从步。','Y','9594',NULL,NULL);
INSERT INTO zn_zi_part VALUES('隙','10842',NULL,'阝',NULL,NULL,'𡭴',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'壁際孔也。从𨸏从𡭴，𡭴亦聲。','Y','9649','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('絫','6366',NULL,NULL,NULL,'厽',NULL,'糸',NULL,NULL,NULL,NULL,NULL,'2024-01-23 22:26:40','增也。从厽从糸。絫，十黍之重也。','Y','9669',NULL,NULL);
INSERT INTO zn_zi_part VALUES('垒','6361',NULL,NULL,NULL,'厽',NULL,'土',NULL,NULL,NULL,NULL,NULL,'2024-01-23 22:27:58','絫墼也。从厽从土。','Y','9670','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('馗','6123',NULL,'九',NULL,NULL,NULL,NULL,NULL,'首',NULL,NULL,NULL,NULL,'九達道也。似龜背，故謂之馗。馗，高也。从九从首。','Y','9682',NULL,NULL);
INSERT INTO zn_zi_part VALUES('离','6426',NULL,'',NULL,'亠乂凵','冂','',NULL,'',NULL,NULL,'厶','2025-02-16 09:06:24','山神，獸也。从禽頭，从厹从屮。歐陽喬說：离，猛獸也。','Y','9685','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('孕','12513',NULL,NULL,NULL,'乃','子',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-15 12:34:52','褢子也。从子从几。','Y','9718','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('季','4987',NULL,NULL,NULL,'禾',NULL,'子',NULL,NULL,NULL,NULL,NULL,'2024-01-20 22:56:00','少偁也。从子，从稚省，稚亦聲。','Y','9724','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('疏','9469',NULL,'疋',NULL,NULL,'㐬',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-27 19:06:29','通也。从𡿮从疋，疋亦聲。','Y','9740','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('酒','5602',NULL,'氵',NULL,NULL,'酉',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'就也，所以就人性之善惡。从水从酉，酉亦聲。一曰造也，吉凶所造也。 古者儀狄作酒醪，禹嘗之而美，遂䟽儀狄。杜康作秫酒。','Y','9758','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('酎','13150',NULL,'酉',NULL,NULL,'寸',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 01:09:37','三重醇酒也。从酉，从時省。《明堂月令》曰：“孟秋，天子飲酎。”','Y','9772',NULL,NULL);
INSERT INTO zn_zi_part VALUES('酣','4288',NULL,'酉',NULL,NULL,'甘',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'酒樂也。从酉从甘，甘亦聲。','Y','9794','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('醉','13485',NULL,'酉',NULL,NULL,'卒',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'卒也。卒其度量，不至於亂也。一曰潰也。从酉从卒。','Y','9800','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('章','12760',NULL,NULL,NULL,'音',NULL,'十',NULL,NULL,NULL,NULL,NULL,'2024-01-27 13:05:21','樂竟爲一章。从音从十。十，數之終也。','Y','1735','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('甚','9289',NULL,NULL,NULL,NULL,'其','乚',NULL,NULL,NULL,NULL,NULL,'2025-02-20 22:22:34','尤安樂也。从甘，从匹耦也。','Y','3026','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('森','9077',NULL,NULL,'木','木',NULL,NULL,NULL,NULL,'木',NULL,NULL,'2024-01-20 05:26:02','木多皃。从林从木。讀若曾參之參。','Y','3838','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('昆','6144',NULL,NULL,NULL,'日',NULL,'比',NULL,NULL,NULL,NULL,NULL,'2024-01-20 03:04:36','同也。从日从比。','Y','4235','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('旄','7130',NULL,'㫃',NULL,NULL,NULL,NULL,NULL,'毛',NULL,NULL,NULL,NULL,'幢也。从㫃从毛，毛亦聲。','Y','4280',NULL,NULL);
INSERT INTO zn_zi_part VALUES('旅','6946',NULL,'方',NULL,'',NULL,'','丿 一','','氏',NULL,NULL,'2025-02-16 09:07:21','軍之五百人爲旅。从㫃从从。从，俱也。','Y','4282','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('族','13450',NULL,'方',NULL,'',NULL,'','丿 一',NULL,'矢',NULL,NULL,'2025-02-08 17:03:30','矢鋒也。束之族族也。从㫃从矢。','Y','4283','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('敝','1659',NULL,NULL,NULL,NULL,'㡀',NULL,NULL,'攵',NULL,NULL,NULL,NULL,'帗也。一曰敗衣。从攴从㡀，㡀亦聲。','Y','4919',NULL,NULL);
INSERT INTO zn_zi_part VALUES('仚','10879',NULL,'亻',NULL,NULL,'山',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'人在山上。从人从山。','Y','5166',NULL,NULL);
INSERT INTO zn_zi_part VALUES('先','10882','',NULL,NULL,'⺧','','儿',NULL,NULL,NULL,NULL,NULL,'2025-02-16 09:09:23','前進也。从儿从之。凡先之屬皆从先。','Y','5444','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('彰','12755',NULL,'彡',NULL,NULL,NULL,NULL,NULL,'章',NULL,NULL,NULL,NULL,'文彰也。从彡从章，章亦聲。','Y','5687','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('契','8333',NULL,NULL,NULL,'㓞',NULL,'大',NULL,NULL,NULL,NULL,NULL,'2024-01-28 10:30:54','大約也。从大从㓞。《易》曰：“後代聖人易之以書契。”','Y','6580','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('圉','12299',NULL,'㚔',NULL,NULL,NULL,NULL,NULL,'囗',NULL,NULL,NULL,NULL,'囹圄，所以拘罪人。从㚔从囗。一曰圉，垂也。一曰圉人，掌馬者。','Y','6614',NULL,NULL);
INSERT INTO zn_zi_part VALUES('奏','13441',NULL,NULL,NULL,'三','人','夭',NULL,NULL,NULL,NULL,NULL,'2024-01-28 12:44:43','奏進也。从𠦍从廾从屮。屮，上進之義。','Y','6626','in HSK / incomplete',NULL);
INSERT INTO zn_zi_part VALUES('涯','11476',NULL,'氵',NULL,NULL,'厓',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'水邊也。从水从厓，厓亦聲。','Y','7434','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('娶','8727',NULL,NULL,NULL,'取',NULL,'女',NULL,NULL,NULL,NULL,NULL,'2024-01-18 21:23:24','取婦也。从女从取，取亦聲。','Y','8086','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('妻','8232',NULL,NULL,NULL,'屮','彐','女',NULL,NULL,NULL,NULL,NULL,'2025-04-05 11:54:37','婦與夫齊者也。从女从屮从又。又，持事，妻職也。','Y','8089','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('乂','11883',NULL,'丿',NULL,NULL,NULL,NULL,NULL,'乀',NULL,NULL,NULL,NULL,'芟艸也。从丿从乀，相交。','Y','8319',NULL,NULL);
INSERT INTO zn_zi_part VALUES('匠','5259',NULL,NULL,NULL,NULL,'匚',NULL,NULL,NULL,NULL,NULL,'斤','2024-01-15 13:12:21','木工也。从匚从斤。斤，所以作器也。','Y','8383','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('弢','9933',NULL,'弓',NULL,NULL,'𠬢',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'弓衣也。从弓从𠬢。𠬢，垂飾，與𡔷同意。','Y','8455',NULL,NULL);
INSERT INTO zn_zi_part VALUES('埽','9054',NULL,'土',NULL,NULL,NULL,NULL,NULL,'帚',NULL,NULL,NULL,NULL,'棄也。从土从帚。','Y','9020',NULL,NULL);
INSERT INTO zn_zi_part VALUES('官','4133',NULL,NULL,NULL,'宀','𠂤',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'吏，事君也。从宀从𠂤。𠂤猶眾也。此與師同意。','Y','9569','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('陷','10970',NULL,'阝',NULL,NULL,'臽',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'高下也。一曰陊也。从𨸏从臽，臽亦聲。','Y','9595','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('辛','11158',NULL,NULL,NULL,'立',NULL,'十',NULL,NULL,NULL,NULL,NULL,'2024-01-23 22:56:32','秋時萬物成而孰；金剛，味辛，辛痛即泣出。从一从䇂。䇂，辠也。辛承庚，象人股。凡辛之屬皆从辛。','Y','9707','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('整','12933','束',NULL,NULL,NULL,NULL,'正','攵',NULL,NULL,NULL,NULL,'2024-01-27 23:23:46','齊也。从攴从束从正，正亦聲。','Y','1995','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('愚','12244',NULL,NULL,NULL,'禺',NULL,'心',NULL,NULL,NULL,NULL,NULL,NULL,'戇也。从心从禺。禺，猴屬，獸之愚者。','Y','6792','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('婢','1647',NULL,'女',NULL,NULL,'卑',NULL,NULL,NULL,NULL,NULL,NULL,NULL,'女之卑者也。从女从卑，卑亦聲。','Y','8120',NULL,NULL);
INSERT INTO zn_zi_part VALUES('弗','3666',NULL,'乀',NULL,NULL,NULL,NULL,NULL,'韋',NULL,NULL,NULL,NULL,'撟也。从丿从乀，从韋省。','Y','8320',NULL,NULL);
INSERT INTO zn_zi_part VALUES('坤','6140',NULL,'土',NULL,NULL,NULL,NULL,NULL,'申',NULL,NULL,NULL,NULL,'地也。《易》之卦也。从土从申。土位在申。','Y','8976','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('堇','5462',NULL,'土',NULL,'廿','口','丰',NULL,NULL,NULL,NULL,NULL,'2024-01-18 22:12:05','黏土也。从土，从黃省。凡堇之屬皆从堇。','Y','9120',NULL,NULL);
INSERT INTO zn_zi_part VALUES('六','6799',NULL,NULL,NULL,'亠',NULL,'八',NULL,NULL,NULL,NULL,NULL,'2024-01-14 13:29:44','《易》之數，陰變於六，正於八。从入从八。凡六之屬皆从六。','Y','9679','in HSK','six');
INSERT INTO zn_zi_part VALUES('化','4622',NULL,'亻',NULL,NULL,'匕',NULL,NULL,'',NULL,NULL,NULL,'2025-04-28 07:31:31','教行也。从𠤎从人，𠤎亦聲。','Y','5192','in HSK',NULL);
INSERT INTO zn_zi_part VALUES('丕','7999',NULL,NULL,NULL,NULL,'不','一',NULL,NULL,NULL,NULL,NULL,NULL,'大也。从一不聲。','Y','4',NULL,NULL);
INSERT INTO zn_zi_part VALUES('帝','2976',NULL,NULL,NULL,'亠 丷','冖','巾',NULL,NULL,NULL,NULL,NULL,'2024-01-27 00:51:16','諦也。王天下之號也。从丄朿聲。','Y','7','in HSK',NULL);
