INSERT INTO zn_zi_part VALUES('亿','11889',NULL,'亻',NULL,NULL,'乙',NULL,NULL,NULL,NULL,NULL,NULL,'2025-03-05 20:23:54','亿 (yì) = 100,000,000 (8 zeros)','Y',NULL,'from HSK',replace('"亿" (yì) is a Chinese numerical unit that represents 100,000,000 or 10^8 (10 to the 8th power). It contains 8 zeros: 100,000,000.\n\nIn the Chinese counting system, large numbers are grouped differently than in Western systems:\n- 十 (shí) = 10 (1 zero)\n- 百 (bǎi) = 100 (2 zeros)\n- 千 (qiān) = 1,000 (3 zeros)\n- 万 (wàn) = 10,000 (4 zeros)\n- 十万 (shí wàn) = 100,000 (5 zeros)\n- 百万 (bǎi wàn) = 1,000,000 (6 zeros)\n- 千万 (qiān wàn) = 10,000,000 (7 zeros)\n- 亿 (yì) = 100,000,000 (8 zeros)\n\nThis unit is commonly used in Chinese-speaking regions to express large quantities such as population figures, financial amounts, and statistics.','\n',char(10)));
