INSERT INTO zn_zi_part VALUES('礊','13915',NULL,NULL,NULL,'毄',NULL,'石',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','堅也。从石毄聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䂬','13916',NULL,NULL,NULL,'巩',NULL,'石',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','水邊石。从石巩聲。《春秋傳》曰：“闕䂬之甲。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('礱','13917',NULL,NULL,NULL,'龍',NULL,'石',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','䃺也。从石龍聲。天子之桷，椓而礱之。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('硩','13918',NULL,NULL,NULL,'折',NULL,'石',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','上摘巖空青、珊瑚墮之。从石折聲。《周禮》有硩蔟氏。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('磿','13919',NULL,NULL,NULL,'厤','石',NULL,NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','石聲也。从石厤聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鏨','13920',NULL,NULL,NULL,'斬',NULL,'金',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','小鑿也。从金从斬，斬亦聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('銜','13922',NULL,NULL,NULL,NULL,'行',NULL,NULL,NULL,NULL,NULL,'金','2024-02-07 23:14:48','馬勒口中。从金从行。銜，行馬者也。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鋻','13923',NULL,NULL,NULL,'臤',NULL,'金',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','剛也。从金臤聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鈭','13924',NULL,NULL,NULL,'此',NULL,'金',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','鈭錍，釜也。从金此聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鐅','13925',NULL,NULL,NULL,'敝',NULL,'金',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','河内謂臿頭金也。从金敝聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鑋','13926',NULL,NULL,NULL,'輕',NULL,'金',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','金聲也。从金輕聲。讀若《春秋傳》曰“𨆪而乘它車”。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('銴','13927',NULL,NULL,NULL,'折',NULL,'金',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','車樘結也。一曰銅生五色也。从金折聲。讀若誓。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鐜','13928',NULL,NULL,NULL,'敦',NULL,'金',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','下垂也。一曰千斤椎。从金敦聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鋚','13929',NULL,NULL,NULL,'攸',NULL,'金',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','鐵也。一曰轡首銅。从金攸聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鄨','13930',NULL,NULL,NULL,'敝',NULL,'邑',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','䍧牱縣。从邑敝聲。讀若鷩雉之鷩。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('驁','13931',NULL,NULL,NULL,'敖',NULL,'馬',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','駿馬。以壬申日死，乘馬忌之。从馬敖聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('篤','13932',NULL,NULL,NULL,'⺮','馬',NULL,NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','馬行頓遟。从馬竹聲。','Y',NULL,'','');
