INSERT INTO zn_zi_part VALUES('騖','13934',NULL,NULL,NULL,'敄',NULL,'馬',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','亂馳也。从馬敄聲。','Y',NULL,'','');
