INSERT INTO zn_zi_part VALUES('驘','13936',NULL,NULL,'月','亡','口','马',NULL,NULL,'凡',NULL,NULL,'2024-02-10 18:33:44','驢父馬母。从馬𦝠聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('騰','13938',NULL,NULL,NULL,'朕',NULL,'馬',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','傳也。从馬朕聲。一曰騰，犗馬也。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('驀','13939',NULL,NULL,NULL,'莫',NULL,'馬',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','上馬也。从馬莫聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('駕','13940',NULL,NULL,NULL,'加',NULL,'馬',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','馬在軛中。从馬加聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('㹂','13941',NULL,NULL,NULL,'臤',NULL,'牛',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','牛很不從引也。从牛从臤，臤亦聲。一曰大皃。讀若賢。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('㹃','13942',NULL,NULL,NULL,'非',NULL,'牛',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','兩壁耕也。从牛非聲。一曰覆耕穜也。讀若匪。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('獘','13943',NULL,NULL,NULL,'敝',NULL,'犬',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','頓仆也。从犬敝聲。《春秋傳》曰：“與犬，犬獘。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('類','13944','米',NULL,'犬',NULL,NULL,NULL,NULL,'页',NULL,NULL,NULL,'2024-02-07 23:14:48','種類相似，唯犬爲甚。从犬頪聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('猌','13945',NULL,'來',NULL,NULL,NULL,NULL,NULL,'犬',NULL,NULL,NULL,'2024-02-07 23:14:48','犬張齗怒也。从犬來聲。讀又若銀。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('㺉','13946','士','冖一','犬',NULL,NULL,NULL,NULL,'殳',NULL,NULL,NULL,'2024-02-07 23:14:48','犬屬。𦝫已上黃，𦝫已下黑，食母猴。从犬𣪊聲。讀若構。或曰㺉似牂羊，出蜀北嚻山中，犬首而馬尾。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鮆','13947',NULL,NULL,NULL,'此',NULL,'魚',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','飲而不食，刀魚也。九江有之。从魚此聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('舊','13948',NULL,NULL,NULL,'艹','隹','臼',NULL,NULL,NULL,NULL,NULL,'2024-02-07 23:14:48','𨾦舊，舊畱也。从雈臼聲。','Y',NULL,'','old');
