INSERT INTO zn_zi_part VALUES('鳴','13957',NULL,'口',NULL,NULL,'鸟',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 17:18:37','鳥聲也。从鳥从口。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鑾','13525','纟',NULL,NULL,'言',NULL,'金','纟',NULL,NULL,NULL,NULL,'2024-01-20 17:24:04','人君乘車，四馬鑣，八鑾鈴，象鸞鳥聲，和則敬也。从金，从鸞省。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鸞','13526','纟',NULL,NULL,'言',NULL,'鸟','纟',NULL,NULL,NULL,NULL,'2024-01-20 17:27:08','亦神靈之精也。赤色，五采，雞形。鳴中五音，頌聲作則至。从鳥䜌聲。周成王時氐羌獻鸞鳥。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䲱','13958',NULL,'鸟',NULL,NULL,'方',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 17:28:20','澤虞也。从鳥方聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䳀','13959',NULL,'鸟',NULL,NULL,'失',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 17:28:57','鋪豉也。从鳥失聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䳔','13960',NULL,NULL,NULL,'臼',NULL,'鸟',NULL,NULL,NULL,NULL,NULL,'2024-01-20 17:29:34','鳥也。从鳥臼聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鷺','13961',NULL,NULL,NULL,'路',NULL,'鸟',NULL,NULL,NULL,NULL,NULL,'2024-01-20 17:30:07','白鷺也。从鳥路聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鴚','13962',NULL,'鸟',NULL,NULL,'可',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 17:30:46','鴚鵝也。从鳥可聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鶩','13963',NULL,NULL,NULL,'敄',NULL,'鸟',NULL,NULL,NULL,NULL,NULL,'2024-01-20 17:31:12','舒鳧也。从鳥敄聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鷙','13964',NULL,NULL,NULL,'執',NULL,'鸟',NULL,NULL,NULL,NULL,NULL,'2024-01-20 17:32:14','擊殺鳥也。从鳥執聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鵔','13965',NULL,'鸟',NULL,NULL,'夋',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 17:33:14','鵔鸃，鷩也。从鳥夋聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鸃','13966',NULL,'鸟',NULL,NULL,'義',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 17:33:40','鵔鸃也。从鳥義聲。秦漢之初，侍中冠鵔鸃冠。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鷢','13536',NULL,NULL,NULL,'厥',NULL,'鸟',NULL,NULL,NULL,NULL,NULL,'2024-01-20 17:40:00','白鷢，王鴡也。从鳥厥聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䴎','13537',NULL,NULL,NULL,'畾',NULL,'鸟',NULL,NULL,NULL,NULL,NULL,'2024-01-20 17:40:27','鼠形。飛走且乳之鳥也。从鳥畾聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('畾','6348',NULL,NULL,'田','田',NULL,NULL,NULL,NULL,'田',NULL,NULL,'2024-01-20 17:41:18','','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鳳','13539',NULL,NULL,NULL,NULL,'几',NULL,NULL,NULL,NULL,NULL,'鸟','2024-01-20 17:54:23','神鳥也。天老曰：“鳳之象也，鴻前麐後，蛇頸魚尾，鸛顙鴛思，龍文虎背，燕頷雞喙，五色備舉。出於東方君子之國，翺翔四海之外，過崐崘，飲砥柱，濯羽弱水，莫宿風穴。見則天下大安寕。”从鳥凡聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鷈','13540',NULL,'鸟',NULL,NULL,'虒',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 17:55:01','𪇊鷈也。从鳥虒聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鳧','13541',NULL,NULL,NULL,'鸟',NULL,'几',NULL,NULL,NULL,NULL,NULL,'2025-04-28 07:53:51','舒鳧，鶩也。从鳥𠘧聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鶃','13542',NULL,'鸟',NULL,NULL,'兒',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 17:55:54','鳥也。从鳥兒聲。《春秋傳》曰：“六鶃退飛。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鴛','13543',NULL,NULL,NULL,'夗',NULL,'鸟',NULL,NULL,NULL,NULL,NULL,'2024-01-20 17:56:13','鴛鴦也。从鳥夗聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䳼','13544',NULL,'鸟',NULL,NULL,'區',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 17:56:48','水鴞也。从鳥區聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鷻','13545',NULL,'鸟',NULL,NULL,'敦',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 17:57:31','雕也。从鳥敦聲。《詩》曰：“匪鷻匪𪀝。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䴌','13546',NULL,'鸟',NULL,NULL,'蒙',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 17:57:46','水鳥也。从鳥蒙聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鸑','13547',NULL,NULL,NULL,'獄',NULL,'鸟',NULL,NULL,NULL,NULL,NULL,'2024-01-20 17:58:13','鸑鷟，鳳屬，神鳥也。从鳥獄聲。《春秋國語》曰：“周之興也，鸑鷟鳴於岐山。”江中有鸑鷟，似鳧而大，赤目。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('獄','13548',NULL,'犭',NULL,NULL,'言',NULL,NULL,'犬',NULL,NULL,NULL,'2024-01-20 17:59:30','','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鴦','13549',NULL,NULL,NULL,'央',NULL,'鸟',NULL,NULL,NULL,NULL,NULL,'2024-01-20 18:00:20','鴛鴦也。从鳥央聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鷖','13550',NULL,NULL,NULL,'殹',NULL,'鸟',NULL,NULL,NULL,NULL,NULL,'2024-01-20 18:00:46','鳧屬。从鳥殹聲。《詩》曰：“鳧鷖在梁。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䳁','13551',NULL,'鸟',NULL,NULL,'犮',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 18:02:58','鳥也。从鳥犮聲。讀若撥。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鴜','13552',NULL,NULL,NULL,'此',NULL,'鸟',NULL,NULL,NULL,NULL,NULL,'2024-01-20 18:03:18','𪈁鴜也。从鳥此聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鸔','13553',NULL,'鸟',NULL,NULL,'暴',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 18:03:44','烏鸔也。从鳥暴聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鷟','13554',NULL,NULL,NULL,'族',NULL,'鸟',NULL,NULL,NULL,NULL,NULL,'2024-01-20 18:05:22','鸑鷟也。从鳥族聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䳘','13555',NULL,'鸟',NULL,NULL,'我',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 18:05:44','鴚鵝也。从鳥我聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('達','13556',NULL,NULL,'辶',NULL,'羍',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 18:12:40','行不相遇也。从辵羍聲。《詩》曰：“挑兮達兮。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('羋','13557',NULL,NULL,NULL,'卝','丨','羊',NULL,NULL,NULL,NULL,NULL,'2024-01-20 18:17:19','羊鳴也。从羊，象聲气上出。與牟同意。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('羣','13558',NULL,NULL,NULL,'君',NULL,'羊',NULL,NULL,NULL,NULL,NULL,'2024-01-20 18:17:46','輩也。从羊君聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𣀆','13559','君',NULL,'羊',NULL,NULL,NULL,NULL,'攵',NULL,NULL,NULL,'2024-01-20 18:19:04','朋侵也。从攴从羣，羣亦聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('麗','13560',NULL,NULL,NULL,'丽',NULL,'鹿',NULL,NULL,NULL,NULL,NULL,'2024-01-20 20:56:33','旅行也。鹿之性，見食急則必旅行。从鹿丽聲。《禮》：麗皮納聘。蓋鹿皮也。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('麉','13561','干',NULL,NULL,NULL,NULL,'鹿','干',NULL,NULL,NULL,NULL,'2024-01-20 20:59:43','鹿之絕有力者。从鹿幵聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('觢','13562',NULL,NULL,NULL,'㓞',NULL,'角',NULL,NULL,NULL,NULL,NULL,'2024-01-20 21:09:18','一角仰也。从角㓞聲。《易》曰：“其牛觢。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䚫','13563',NULL,NULL,NULL,'敫',NULL,'角',NULL,NULL,NULL,NULL,NULL,'2024-01-20 21:10:54','杖耑角也。从角敫聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('觠','13564',NULL,NULL,NULL,'丷','夫','角',NULL,NULL,NULL,NULL,NULL,'2024-01-20 21:11:31','曲角也。从角𢍏聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('觓','13565',NULL,NULL,NULL,NULL,'角',NULL,NULL,'丩',NULL,NULL,NULL,'2024-01-20 21:14:12','角皃。从角丩聲。《詩》曰：“兕觵其觓。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('豰','13566','士','冖一','豕',NULL,NULL,NULL,NULL,'殳',NULL,NULL,NULL,'2024-01-20 21:18:40','小豚也。从豕𣪎聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('虪','13567',NULL,'虎',NULL,NULL,'儵',NULL,NULL,NULL,NULL,NULL,NULL,'2024-02-13 22:28:12','黑虎也。从虎儵聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䖘','13568',NULL,'虎',NULL,NULL,'兔',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 21:32:57','楚人謂虎爲烏䖘。从虎兔聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('號','13569',NULL,NULL,NULL,NULL,'号',NULL,NULL,'虎',NULL,NULL,NULL,'2024-01-20 21:32:11','呼也。从号从虎。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('虨','13570','虍',NULL,'林',NULL,NULL,NULL,NULL,'彡',NULL,NULL,NULL,'2024-01-20 21:35:39','虎文，彪也。从虍彬聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('聲','13571',NULL,NULL,NULL,'殸',NULL,'耳',NULL,NULL,NULL,NULL,NULL,'2024-01-20 22:22:53','音也。从耳殸聲。殸，籒文磬。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('聾','13572',NULL,NULL,NULL,'龍',NULL,'耳',NULL,NULL,NULL,NULL,NULL,'2024-01-20 22:24:23','無聞也。从耳龍聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('聖','13573','耳','',NULL,NULL,NULL,'王','口',NULL,NULL,NULL,NULL,'2025-02-16 12:25:00','通也。从耳呈聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('聞','13575',NULL,NULL,NULL,NULL,'門',NULL,NULL,NULL,NULL,NULL,'耳','2024-01-20 22:27:20','知聞也。从耳門聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('齧','13576',NULL,NULL,NULL,'㓞',NULL,'齿',NULL,NULL,NULL,NULL,NULL,'2024-01-20 22:37:21','噬也。从齒㓞聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𣡌','13577',NULL,'木',NULL,NULL,'獻',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 22:38:48','伐木餘也。从木獻聲。《商書》曰：“若顚木之有纫𣡌。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('獻','13578',NULL,NULL,NULL,NULL,'鬳',NULL,NULL,'犬',NULL,NULL,NULL,'2024-01-20 22:39:36','宗廟犬名羹獻。犬肥者以獻之。从犬鬳聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('廈','13579',NULL,NULL,NULL,'广','夏',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 22:49:27','屋也。从广夏聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('順','13580',NULL,NULL,NULL,NULL,'川',NULL,NULL,'页',NULL,NULL,NULL,'2024-01-20 22:50:01','理也。从頁从巛。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('煩','13581',NULL,'火',NULL,NULL,NULL,NULL,NULL,'页',NULL,NULL,NULL,'2024-01-20 22:51:02','熱頭痛也。从頁从火。一曰焚省聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䪾','13582',NULL,'页',NULL,NULL,'㐱',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 22:51:49','顔色䪾䫰，愼事也。从頁㐱聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䫰','13583',NULL,'页',NULL,NULL,'粦',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-20 22:52:08','䪾䫰也。从頁粦聲。一曰頭少髮。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('頢','13584',NULL,NULL,NULL,NULL,'舌',NULL,NULL,'页',NULL,NULL,NULL,'2024-01-20 22:53:20','短面也。从頁𠯑聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('㝅','13585','士','冖一','子',NULL,NULL,NULL,NULL,'殳',NULL,NULL,NULL,'2024-01-20 22:57:03','乳也。从子𣪊聲。一曰㝅瞀也。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('孿','13586','纟',NULL,NULL,'言',NULL,'子','纟',NULL,NULL,NULL,NULL,'2024-01-20 22:59:01','一乳兩子也。从子䜌聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𡥈','13587',NULL,NULL,NULL,'爻',NULL,'子',NULL,NULL,NULL,NULL,NULL,'2024-01-20 22:59:27','放也。从子爻聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('孼','13588',NULL,NULL,NULL,'辥',NULL,'子',NULL,NULL,NULL,NULL,NULL,'2024-01-20 22:59:58','庶子也。从子辥聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('毦','13589',NULL,NULL,NULL,NULL,'耳',NULL,NULL,'毛',NULL,NULL,NULL,'2024-01-20 23:05:21','羽毛飾也。从毛耳聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('㲦','13590','','龺','',NULL,NULL,NULL,'人',NULL,'毛',NULL,NULL,'2025-02-16 12:26:25','獸豪也。从毛倝聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('㲪','13591',NULL,NULL,NULL,NULL,'登',NULL,NULL,'毛',NULL,NULL,NULL,'2024-01-20 23:08:56','毾㲪也。从毛登聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䰰','13592',NULL,NULL,NULL,NULL,'需',NULL,NULL,'鬼',NULL,NULL,NULL,'2024-01-20 23:11:11','鬼鬽聲，䰰䰰不止也。从鬼需聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𩴱','13593',NULL,NULL,NULL,NULL,'賓',NULL,NULL,'鬼',NULL,NULL,NULL,'2024-01-20 23:11:34','鬼皃。从鬼賓聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𩴪','13594',NULL,NULL,NULL,'幾',NULL,'鬼',NULL,NULL,NULL,NULL,NULL,'2024-01-20 23:11:59','鬼俗也。从鬼幾聲。《淮南傳》曰：“吳人鬼，越人𩴪。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('醜','13595',NULL,NULL,NULL,NULL,'酉',NULL,NULL,'鬼',NULL,NULL,NULL,'2024-01-20 23:12:20','可惡也。从鬼酉聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('魘','13596',NULL,NULL,NULL,'厭',NULL,'鬼',NULL,NULL,NULL,NULL,NULL,'2024-01-20 23:12:44','㝱驚也。从鬼厭聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𩲏','13597',NULL,NULL,NULL,NULL,'化',NULL,NULL,'鬼',NULL,NULL,NULL,'2024-01-20 23:13:34','鬼變也。从鬼化聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('隉','13598',NULL,'阝',NULL,'',NULL,'','臼',NULL,'土',NULL,NULL,'2025-02-16 12:26:43','危也。从𨸏，从毀省。徐巡以爲：隉，凶也。賈侍中說：隉，法度也。班固說：不安也。《周書》曰：“邦之阢隉。”讀若虹蜺之蜺。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('穅','13599',NULL,'禾',NULL,NULL,'康',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 00:32:40','榖皮也。从禾从米，庚聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䅁','13600',NULL,NULL,NULL,'安',NULL,'禾',NULL,NULL,NULL,NULL,NULL,'2024-01-21 00:36:48','轢禾也。从禾安聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('稾','13601',NULL,NULL,NULL,'','高','禾',NULL,NULL,NULL,NULL,NULL,'2025-03-03 07:22:08','稈也。从禾高聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𥞥','13602',NULL,NULL,NULL,'列',NULL,'禾',NULL,NULL,NULL,NULL,NULL,'2024-01-21 00:38:20','黍穰也。从禾𠛱聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('秊','13603',NULL,NULL,NULL,'禾',NULL,'千',NULL,NULL,NULL,NULL,NULL,'2024-01-21 00:38:48','穀孰也。从禾千聲。《春秋傳》曰：“大有秊。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䆃','13604',NULL,NULL,NULL,'道',NULL,'禾',NULL,NULL,NULL,NULL,NULL,'2024-01-21 00:39:09','禾也。从禾道聲。司馬相如曰：“䆃，一莖六穗。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('穌','13605',NULL,'鱼',NULL,NULL,NULL,NULL,NULL,'禾',NULL,NULL,NULL,'2024-01-21 00:40:14','把取禾若也。从禾魚聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('蘇','13606',NULL,NULL,NULL,'艹','穌',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 00:40:44','桂荏也。从艸穌聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('穀','13607','士','冖一','禾',NULL,NULL,NULL,NULL,'殳',NULL,NULL,NULL,'2024-01-21 00:41:41','續也。百穀之緫名。从禾𣪊聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('繭','13608',NULL,'纟',NULL,'艹','丨',NULL,NULL,'虫',NULL,'冂',NULL,'2024-01-21 00:46:48','蠶衣也。从糸从虫，黹省。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䋰','13609',NULL,NULL,NULL,'具',NULL,'糸',NULL,NULL,NULL,NULL,NULL,'2024-01-21 00:48:14','約也。从糸具聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('纍','13610',NULL,NULL,NULL,'畾',NULL,'糸',NULL,NULL,NULL,NULL,NULL,'2024-01-21 00:51:08','綴得理也。一曰大索也。从糸畾聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('壘','13611',NULL,NULL,NULL,'畾',NULL,'土',NULL,NULL,NULL,NULL,NULL,'2024-01-21 00:51:47','軍壁也。从土畾聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䋢','13612',NULL,NULL,NULL,'折',NULL,'糸',NULL,NULL,NULL,NULL,NULL,'2024-01-21 00:52:55','扁緒也。一曰弩𦝫鉤帶。从糸折聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('絭','13613',NULL,NULL,NULL,'丷','夫','糸',NULL,NULL,NULL,NULL,NULL,'2024-01-21 00:53:34','攘臂繩也。从糸𢍏聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䋣','13614',NULL,NULL,NULL,NULL,'每',NULL,NULL,'糸',NULL,NULL,NULL,'2025-04-28 07:22:42','馬髦飾也。从糸𣫭聲。《春秋傳》曰：“可以稱旌緐乎？”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('樂','13615','幺',NULL,NULL,'白',NULL,'木','幺',NULL,NULL,NULL,NULL,'2024-01-21 00:59:03','','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('繴','13616',NULL,NULL,NULL,'辟',NULL,'糸',NULL,NULL,NULL,NULL,NULL,'2024-01-21 00:59:55','繴謂之罿，罿謂之罬，罬謂之罦。捕鳥覆車也。从糸辟聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䋈','13617',NULL,NULL,NULL,'奴',NULL,'糸',NULL,NULL,NULL,NULL,NULL,'2024-01-21 01:00:23','絜緼也。一曰敝絮。从糸奴聲。《易》曰：“需有衣䋈。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𥿩','13618',NULL,NULL,NULL,'次',NULL,'糸',NULL,NULL,NULL,NULL,NULL,'2024-01-21 01:00:47','績所緝也。从糸次聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('繫','13619',NULL,NULL,NULL,'毄',NULL,'糸',NULL,NULL,NULL,NULL,NULL,'2024-01-21 01:01:54','繫𦃇也。一曰惡絮。从糸毄聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䋀','13620',NULL,NULL,NULL,'户','糸',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 01:03:12','履也。一曰青絲頭履也。讀若阡陌之陌。从糸戶聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('潔','13621',NULL,'氵',NULL,NULL,'絜',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 01:04:39','瀞也。从水絜聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('纇','13622','米',NULL,'糸',NULL,NULL,NULL,NULL,'页',NULL,NULL,NULL,'2024-01-21 01:05:49','絲節也。从糸頪聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('莤','13623',NULL,NULL,NULL,'艹','酉',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 01:10:18','禮祭，束茅，加于祼圭，而灌鬯酒，是爲莤。象神歆之也。一曰莤，榼上塞也。从酉从艸。《春秋傳》曰：“尔貢包茅不入，王祭不供，無以莤酒。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('酨','13624','十',NULL,'酉',NULL,NULL,NULL,NULL,'戈',NULL,NULL,NULL,'2024-01-21 01:11:10','酢𤖅也。从酉𢦔聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('習','13625',NULL,NULL,NULL,'羽',NULL,'白',NULL,NULL,NULL,NULL,NULL,'2024-01-21 01:15:38','數飛也。从羽从白。凡習之屬皆从習。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𦐇','13627',NULL,NULL,NULL,'日','羽',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 01:18:21','飛盛皃。从羽从冃。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('翹','13628',NULL,NULL,NULL,NULL,'堯',NULL,NULL,'羽',NULL,NULL,NULL,'2024-01-21 01:19:51','尾長毛也。从羽堯聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('翜','13629',NULL,NULL,NULL,'羽','夾',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 01:23:16','捷也。飛之疾也。从羽夾聲。讀若瀒。一曰俠也。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('翽','13630',NULL,NULL,NULL,NULL,'歲',NULL,NULL,'羽',NULL,NULL,NULL,'2024-01-21 01:28:16','飛聲也。从羽歲聲。《詩》曰：“鳳皇于飛，翽翽其羽。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䍿','13631',NULL,NULL,NULL,'羽','王',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 01:28:50','樂舞。以羽纣自翳其首，以祀星辰也。从羽王聲。讀若皇。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('翇','13632',NULL,NULL,NULL,'羽','犮',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 01:29:04','樂舞。執全羽以祀社稷也。从羽犮聲。讀若紱。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𦐉','13633',NULL,NULL,NULL,NULL,'之','羽',NULL,NULL,NULL,NULL,NULL,'2024-01-21 01:31:57','飛盛㒵。从羽之聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𦑜','13634',NULL,NULL,NULL,NULL,'革',NULL,NULL,'羽',NULL,NULL,NULL,'2024-01-21 01:33:12','翅也。从羽革聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𦐛','13635',NULL,NULL,NULL,NULL,'句',NULL,NULL,'羽',NULL,NULL,NULL,'2024-01-21 01:34:04','羽曲也。从羽句聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('翬','13636',NULL,NULL,NULL,'羽','軍',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 01:34:42','大飛也。从羽軍聲。一曰伊、雒而南，雉五采皆備曰翬。《詩》曰：“如翬斯飛。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𦏺','13637',NULL,NULL,NULL,NULL,'工','羽',NULL,NULL,NULL,NULL,NULL,'2024-01-21 01:35:03','飛聲。从羽工聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('翨','13638',NULL,NULL,NULL,'羽','是',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 01:35:32','鳥之彊羽猛者。从羽是聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('徹','13639',NULL,'彳',NULL,NULL,'育',NULL,NULL,'攵',NULL,NULL,NULL,'2024-01-21 08:37:14','通也。从彳从攴从育。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𡕥','13640',NULL,NULL,NULL,NULL,'目','攵',NULL,NULL,NULL,NULL,NULL,'2024-01-21 08:39:46','舉目使人也。从攴从目。凡𡕥之屬皆从𡕥。讀若𩖶。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('變','13641','纟',NULL,NULL,'言',NULL,'攵','纟',NULL,NULL,NULL,NULL,'2024-01-21 08:46:24','更也。从攴䜌聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('敵','13642',NULL,NULL,NULL,NULL,'舌',NULL,NULL,'攵',NULL,NULL,NULL,'2024-01-21 08:48:55','仇也。从攴啻聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𠛰','13643',NULL,NULL,NULL,NULL,'冎',NULL,NULL,'刂',NULL,NULL,NULL,'2024-01-21 08:56:27','分解也。从冎从刀。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('㓝','13644',NULL,NULL,NULL,NULL,'井',NULL,NULL,'刂',NULL,NULL,NULL,'2024-01-21 08:56:56','罰辠也。从井从刀。《易》曰：“井，法也。”井亦聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𩮜','13645',NULL,NULL,'易','髟',NULL,NULL,NULL,NULL,'刀',NULL,NULL,'2024-01-21 18:21:05','鬀髮也。从髟从刀，易聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𢖫','13646',NULL,NULL,NULL,'刀',NULL,'心',NULL,NULL,NULL,NULL,NULL,'2024-01-21 09:01:30','怒也。从心刀聲。讀若𩕺。李陽冰曰：“刀非聲，当从刈省。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𧗳','13647',NULL,NULL,NULL,NULL,'行',NULL,NULL,NULL,NULL,NULL,'言','2024-01-21 09:03:20','行且賣也。从行从言。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('詞','13648',NULL,'讠',NULL,NULL,'司',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 09:06:27','意内而言外也。从司从言。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('琂','13649',NULL,NULL,NULL,NULL,'王',NULL,NULL,'言',NULL,NULL,NULL,'2024-02-13 22:31:39','石之似玉者。从玉言聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𠶷','13650',NULL,NULL,NULL,'立','中','口',NULL,NULL,NULL,NULL,NULL,'2024-01-21 09:14:53','快也。从言从中。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𧥣','13651',NULL,'讠',NULL,NULL,'口',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 09:16:38','扣也。如求婦先𧥣叕之。从言从口，口亦聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('譻','13652','贝',NULL,NULL,NULL,NULL,'言','贝',NULL,NULL,NULL,NULL,'2024-01-21 09:18:07','聲也。从言賏聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𧭭','13653',NULL,NULL,NULL,'𨿳','言',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 09:18:50','以言對也。从言𨿳聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('誾','13654',NULL,NULL,NULL,NULL,'門',NULL,NULL,NULL,NULL,NULL,'言','2024-01-21 09:19:42','和說而諍也。从言門聲。','Y',NULL,'','debate');
INSERT INTO zn_zi_part VALUES('譽','13655',NULL,NULL,NULL,'與',NULL,'言',NULL,NULL,NULL,NULL,NULL,'2024-01-21 09:21:16','（纤）也。从言與聲。','Y',NULL,'','reputation');
INSERT INTO zn_zi_part VALUES('𧧻','13656',NULL,'讠',NULL,NULL,'作',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 09:22:15','慙語也。从言作聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('謺','13657',NULL,NULL,NULL,'執',NULL,'言',NULL,NULL,NULL,NULL,NULL,'2024-01-21 09:22:37','謺讘也。从言執聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𧬮','13658',NULL,'言',NULL,'目',NULL,'大','目',NULL,NULL,NULL,NULL,'2025-04-28 07:51:11','相誤也。从言𥈀聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𧭹','13659',NULL,NULL,NULL,'頻',NULL,'言',NULL,NULL,NULL,NULL,NULL,'2024-01-21 09:23:56','匹也。从言頻聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('諅','13660',NULL,NULL,NULL,'其',NULL,'言',NULL,NULL,NULL,NULL,NULL,'2024-01-21 09:24:25','忌也。从言其聲。《周書》曰：“上不諅于凶德。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𧬨','13661',NULL,NULL,NULL,'歲',NULL,'言',NULL,NULL,NULL,NULL,NULL,'2024-01-21 09:24:55','聲也。从言歲聲。《詩》曰：“有𧬨其聲。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𧮓','13662',NULL,'讠',NULL,NULL,'鬼',NULL,NULL,'隹',NULL,NULL,NULL,'2024-01-21 09:25:49','譟也。从言魋聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𧧁','13663',NULL,NULL,NULL,'夗',NULL,'言',NULL,NULL,NULL,NULL,NULL,'2024-01-21 09:27:07','尉也。从言夗聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('讎','13664',NULL,'隹',NULL,NULL,'言',NULL,NULL,'隹',NULL,NULL,NULL,'2024-01-21 09:29:02','猶𧭭也。从言雔聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('雔','13665',NULL,'隹',NULL,NULL,NULL,NULL,NULL,'隹',NULL,NULL,NULL,'2024-01-21 09:29:39','','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𧧛','13666',NULL,'讠',NULL,NULL,'冄',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 09:31:03','𧧛𧧛，多語也。从言冄聲。樂浪有𧧛邯縣。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('譥','13667',NULL,NULL,NULL,'敫',NULL,'言',NULL,NULL,NULL,NULL,NULL,'2024-01-21 09:31:33','痛呼也。从言敫聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𧮑','13668',NULL,'讠',NULL,NULL,'闒',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 09:32:19','嗑也。从言闒聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𧧹','13669',NULL,'亻',NULL,'',NULL,'','只',NULL,'言',NULL,NULL,'2025-02-16 12:28:06','待也。从言伿聲。讀若䭆。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鞌','13671',NULL,NULL,NULL,'安',NULL,'革',NULL,NULL,NULL,NULL,NULL,'2024-01-21 11:22:20','馬鞁具也。从革从安。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鞏','13672',NULL,NULL,NULL,'巩',NULL,'革',NULL,NULL,NULL,NULL,NULL,'2024-01-21 11:23:22','以韋束也。《易》曰：“鞏用黃牛之革。”从革巩聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𩌦','13673',NULL,'革',NULL,NULL,'徙',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 11:24:38','鞮屬。从革徙聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('鞪','13674',NULL,NULL,NULL,'敄',NULL,'革',NULL,NULL,NULL,NULL,NULL,'2024-01-21 11:27:00','車軸束也。从革敄聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('叕','13314','又',NULL,'又',NULL,NULL,NULL,'又',NULL,'又',NULL,NULL,'2024-01-21 11:29:31','','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𢄢','13676',NULL,NULL,NULL,'執',NULL,'巾',NULL,NULL,NULL,NULL,NULL,'2024-01-21 11:31:50','禮巾也。从巾从執。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('帤','13677',NULL,NULL,NULL,'如',NULL,'巾',NULL,NULL,NULL,NULL,NULL,'2024-01-21 11:51:11','巾帤也。从巾如聲。一曰幣巾。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('帬','13678',NULL,NULL,NULL,'君',NULL,'巾',NULL,NULL,NULL,NULL,NULL,'2024-01-21 11:52:11','下裳也。从巾君聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('㠾','13679',NULL,NULL,NULL,'夗',NULL,'巾',NULL,NULL,NULL,NULL,NULL,'2024-01-21 11:52:49','幡也。从巾夗聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('幐','13680',NULL,'月',NULL,'','','','丷','夫','巾',NULL,NULL,'2025-02-16 12:28:27','囊也。从巾朕聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('帑','9924',NULL,NULL,NULL,'奴',NULL,'巾',NULL,NULL,NULL,NULL,NULL,'2024-01-21 11:54:25','金幣所藏也。从巾奴聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('幦','7313',NULL,NULL,NULL,'辟',NULL,'巾',NULL,NULL,NULL,NULL,NULL,'2024-01-21 11:54:44','䰍布也。从巾辟聲。《周禮》曰：“駹車大幦。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('幕','7522',NULL,NULL,NULL,'莫',NULL,'巾',NULL,NULL,NULL,NULL,NULL,'2024-01-21 11:55:09','帷在上曰幕，覆食案亦曰幕。从巾莫聲。','Y',NULL,'in HSK','');
INSERT INTO zn_zi_part VALUES('㡔','13681',NULL,NULL,NULL,'敄',NULL,'巾',NULL,NULL,NULL,NULL,NULL,'2024-01-21 11:55:36','䰍布也。一曰車上衡衣。从巾敄聲。讀若頊。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('幋','7879',NULL,NULL,NULL,'般',NULL,'巾',NULL,NULL,NULL,NULL,NULL,'2024-01-21 11:56:07','覆衣大巾。从巾般聲。或以爲首鞶。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('帛','1875',NULL,NULL,NULL,'白',NULL,'巾',NULL,NULL,NULL,NULL,NULL,'2024-01-27 12:30:39','繒也。从巾白聲。凡帛之屬皆从帛。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('緜','13682',NULL,'帛',NULL,NULL,NULL,NULL,NULL,'系',NULL,NULL,NULL,'2024-01-21 11:57:06','聮微也。从系从帛。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('常','2153',NULL,NULL,NULL,'尚',NULL,'巾',NULL,NULL,NULL,NULL,NULL,'2024-01-21 11:57:29','下帬也。从巾尚聲。','Y',NULL,'in HSK','');
INSERT INTO zn_zi_part VALUES('幣','13683',NULL,NULL,NULL,'敝',NULL,'巾',NULL,NULL,NULL,NULL,NULL,'2024-01-21 12:05:56','帛也。从巾敝聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('帒','13684',NULL,NULL,NULL,'代',NULL,'巾',NULL,NULL,NULL,NULL,NULL,'2024-01-21 12:06:29','囊也。从巾代聲。或从衣。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𢃴','13685',NULL,NULL,NULL,'剌',NULL,'巾',NULL,NULL,NULL,NULL,NULL,'2024-01-21 12:07:25','刜也。从巾剌聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𢁥','13686',NULL,NULL,NULL,'分',NULL,'巾',NULL,NULL,NULL,NULL,NULL,'2024-01-21 12:08:24','楚謂大巾曰𢁥。从巾分聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('欮','13687',NULL,'屰',NULL,NULL,NULL,NULL,NULL,'欠',NULL,NULL,NULL,'2024-01-21 12:32:50','','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('闕','13688',NULL,NULL,NULL,NULL,'門',NULL,NULL,NULL,NULL,NULL,'欮','2024-01-21 12:34:34','門觀也。从門欮聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('欥','13689',NULL,NULL,NULL,NULL,'曰',NULL,NULL,'欠',NULL,NULL,NULL,'2024-01-21 12:36:03','詮詞也。从欠从曰，曰亦聲。《詩》曰：“欥求厥寕。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('㳄','13690',NULL,'氵',NULL,NULL,NULL,NULL,NULL,'欠',NULL,NULL,NULL,'2024-01-21 12:36:52','慕欲口液也。从欠从水。凡㳄之屬皆从㳄。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𠩗','13691','厂',NULL,NULL,NULL,'㳄',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 12:37:14','歠也。从㳄厂聲。讀若移。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('羨','13692',NULL,NULL,NULL,'⺷','㳄',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 12:38:03','貪欲也。从㳄，从羑省。羑呼之羑，文王所拘羑里。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('欽','13693',NULL,'金',NULL,NULL,NULL,NULL,NULL,'欠',NULL,NULL,NULL,'2024-01-21 12:38:49','欠皃。从欠金聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('㱍','13694',NULL,NULL,NULL,NULL,'䜌',NULL,NULL,'欠',NULL,NULL,NULL,'2024-01-21 12:39:29','欠皃。从欠䜌聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𣤭','13695','咸',NULL,'糸',NULL,NULL,NULL,NULL,'欠',NULL,NULL,NULL,'2024-01-21 12:46:45','監持意。口閉也。从欠緘聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𣢰','13696',NULL,NULL,NULL,NULL,'尗',NULL,NULL,'欠',NULL,NULL,NULL,'2024-01-21 12:48:53','惄然也。从欠尗聲。《孟子》曰：“曾西𣢰然。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('尗','9454',NULL,NULL,NULL,'上',NULL,'小',NULL,NULL,NULL,NULL,NULL,'2024-01-21 12:50:12','','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('脅','13698',NULL,NULL,NULL,'劦',NULL,'月',NULL,NULL,NULL,NULL,NULL,'2024-01-21 12:54:57','兩𦜶也。从肉劦聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('劦','11084',NULL,NULL,'力','力',NULL,NULL,NULL,NULL,'力',NULL,NULL,'2024-01-21 12:55:56','','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𥥊','13701',NULL,NULL,NULL,'穴',NULL,'皿',NULL,NULL,NULL,NULL,NULL,'2024-01-21 13:07:24','北方謂地空，因以爲土穴，爲𥥊戶。从穴皿聲。讀若猛。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𥥻','13702',NULL,NULL,NULL,'穴',NULL,'巠',NULL,NULL,NULL,NULL,NULL,'2024-01-21 13:07:50','空也。从穴巠聲。《詩》曰：“瓶之𥥻矣。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䄟','13703',NULL,NULL,NULL,'毳',NULL,'示',NULL,NULL,NULL,NULL,NULL,'2024-01-21 13:12:47','數祭也。从示毳聲。讀若舂麥爲䄟之䄟。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('㦌','13704',NULL,NULL,NULL,'毳',NULL,'心',NULL,NULL,NULL,NULL,NULL,'2024-01-21 13:13:14','精戇也。从心毳聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䩁','13705',NULL,NULL,NULL,'非',NULL,'毳',NULL,NULL,NULL,NULL,NULL,'2024-01-21 13:13:29','毛紛紛也。从毳非聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('毳','2678',NULL,NULL,'毛','毛',NULL,NULL,NULL,NULL,'毛',NULL,NULL,'2024-01-21 13:14:04','','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('復','13707',NULL,'彳',NULL,NULL,'复',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 15:14:13','往來也。从彳复聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𠣾','13708',NULL,NULL,NULL,NULL,'勹',NULL,NULL,NULL,NULL,NULL,'復','2024-01-21 15:15:07','重也。从勹復聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('蕧','13709',NULL,NULL,NULL,'艹','復',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 15:15:36','盜庚也。从艸復聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('歰','9063','刃',NULL,'止',NULL,NULL,NULL,'刃',NULL,'止',NULL,NULL,'2024-01-21 15:20:59','','Y',NULL,'','');
