INSERT INTO zn_zi_part VALUES('䡓','13712',NULL,NULL,NULL,NULL,'行',NULL,NULL,NULL,NULL,NULL,'车','2024-01-21 15:28:16','車搖也。从車从行。一曰衍省聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('軍','13713',NULL,NULL,NULL,'冖','车',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 15:28:45','圜圍也。四千人爲軍。从車，从包省。軍，兵車也。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('轚','13714',NULL,NULL,NULL,'毄',NULL,'车',NULL,NULL,NULL,NULL,NULL,'2024-01-21 15:29:25','車轄相擊也。从車从毄，毄亦聲。《周禮》曰：“舟輿擊互者。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('輦','13715','夫',NULL,NULL,NULL,NULL,'车','夫',NULL,NULL,NULL,NULL,'2024-01-21 15:30:10','輓車也。从車，从㚘在車前引之。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('輿','13716',NULL,NULL,NULL,'车','一','八',NULL,NULL,NULL,NULL,NULL,'2024-01-21 15:33:04','車輿也。从車舁聲。','Y',NULL,'incomplete','');
INSERT INTO zn_zi_part VALUES('轂','13717','士','冖一','车',NULL,NULL,NULL,NULL,'殳',NULL,NULL,NULL,'2024-01-21 15:34:40','輻所凑也。从車𣪊聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䡰','13718',NULL,NULL,NULL,'殸',NULL,'车',NULL,NULL,NULL,NULL,NULL,'2024-01-21 15:36:26','車堅也。从車殸聲。','Y',NULL,'','');
