INSERT INTO zn_zi_part VALUES('輩','13720',NULL,NULL,NULL,'非',NULL,'车',NULL,NULL,NULL,NULL,NULL,'2024-01-21 15:39:52','若軍發車百兩爲一輩。从車非聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('載','13721','十',NULL,'車',NULL,NULL,NULL,NULL,'戈',NULL,NULL,NULL,'2024-01-21 15:41:06','乘也。从車𢦔聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𨎌','13722',NULL,NULL,NULL,'埶',NULL,'车',NULL,NULL,NULL,NULL,NULL,'2024-01-21 15:41:35','抵也。从車埶聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𥼶','13723',NULL,'米',NULL,NULL,'睪',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 16:03:25','潰米也。从米睪聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𥹆','13724',NULL,NULL,NULL,'米','尼',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 16:03:49','潰米也。从米尼聲。交阯有𥹆泠縣。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𥼓','13725',NULL,'米',NULL,NULL,'𤰈',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 16:04:11','乾也。从米𤰈聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('氣','13726',NULL,NULL,NULL,'气','米',NULL,NULL,NULL,NULL,NULL,'','2025-01-12 08:55:03','饋客芻米也。从米气聲。《春秋傳》曰：“齊人來氣諸矦。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𥻦','13727',NULL,NULL,NULL,NULL,'殺','米',NULL,NULL,NULL,NULL,NULL,'2024-01-21 16:05:11','䊝𥻦，𢿱之也。从米殺聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䉾','13728',NULL,NULL,NULL,NULL,'北','米',NULL,NULL,NULL,NULL,NULL,'2024-01-21 16:06:46','惡米也。从米北聲。《周書》有《䉾誓》。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('糪','13729',NULL,NULL,NULL,NULL,'辟','米',NULL,NULL,NULL,NULL,NULL,'2024-01-21 16:07:03','炊，米者謂之糪。从米辟聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('岪','13730',NULL,NULL,NULL,'山',NULL,'弗',NULL,NULL,NULL,NULL,NULL,'2024-01-21 18:12:26','山脅道也。从山弗聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䞨','13731',NULL,NULL,'走',NULL,'圭',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 18:12:48','半步也。从走圭聲。讀若跬同。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('圭','4188',NULL,NULL,NULL,'土',NULL,'土',NULL,NULL,NULL,NULL,NULL,'2024-01-21 18:14:29','','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𧼒','13733',NULL,NULL,'走',NULL,'臤',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 18:15:45','行皃。从走臤聲。讀若菣。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('臤','13734',NULL,'臣',NULL,NULL,NULL,NULL,NULL,'又',NULL,NULL,NULL,'2024-01-21 19:09:39','堅也。从又臣聲。凡臤之屬皆从臤。讀若鏗鏘之鏗。古文以爲賢字。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('竝','13735',NULL,'立',NULL,NULL,NULL,NULL,NULL,'立',NULL,NULL,NULL,'2024-01-23 22:02:54','','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('虜','13736',NULL,NULL,NULL,'虍','男',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 18:29:44','獲也。从毌从力，虍聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𠣊','13737','非',NULL,'慮',NULL,NULL,NULL,NULL,'力',NULL,NULL,NULL,'2024-01-21 18:31:35','助也。从力从非，慮聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('勶','13738',NULL,NULL,NULL,'徹',NULL,'力',NULL,NULL,NULL,NULL,NULL,'2024-01-21 18:32:00','發也。从力从徹，徹亦聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('飭','13739',NULL,'饣',NULL,NULL,NULL,NULL,'人',NULL,'力',NULL,NULL,'2024-01-21 18:33:17','致堅也。从人从力，食聲。讀若敕。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('勝','13740',NULL,'月',NULL,NULL,NULL,'','丷','夫','力',NULL,NULL,'2025-02-16 12:30:03','任也。从力朕聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('勢','13741',NULL,NULL,NULL,'埶',NULL,'力',NULL,NULL,NULL,NULL,NULL,'2024-01-21 18:35:08','盛力權也。从力埶聲。經典通用埶。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('辦','13742',NULL,'辛',NULL,NULL,'力',NULL,NULL,'辛',NULL,NULL,NULL,'2024-01-21 18:35:56','致力也。从力辡聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𠢤','13743',NULL,NULL,NULL,'厥',NULL,'力',NULL,NULL,NULL,NULL,NULL,'2024-01-21 18:36:26','勥也。从力厥聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('勥','13744',NULL,NULL,NULL,'强',NULL,'力',NULL,NULL,NULL,NULL,NULL,'2024-01-21 18:37:35','迫也。从力强聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𠢕','13745',NULL,NULL,NULL,'敖',NULL,'力',NULL,NULL,NULL,NULL,NULL,'2024-01-21 18:38:00','健也。从力敖聲。讀若豪。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𦌭','13746',NULL,NULL,NULL,'罒','𩡧','中',NULL,NULL,NULL,NULL,NULL,'2024-01-21 18:46:25','馬絡頭也。从网从𩡧。𩡧，馬絆也。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𤃭','13747',NULL,'氵',NULL,NULL,NULL,NULL,'罒',NULL,'焦',NULL,NULL,'2024-01-21 18:47:51','釃酒也。一曰浚也。从网从水，焦聲。讀若《夏書》“天用勦絕”。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𦊍','13748',NULL,NULL,NULL,'网',NULL,'互',NULL,NULL,NULL,NULL,NULL,'2024-01-21 18:52:23','罟也。从网互聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𦌬','13749',NULL,NULL,NULL,'罒','舞',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 18:52:51','牖中网也。从网舞聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𦊾','13750',NULL,NULL,NULL,'罒','否',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 18:53:16','兔罟也。从网否聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䍙','13751',NULL,NULL,NULL,'罒','每',NULL,NULL,NULL,NULL,NULL,NULL,'2025-04-28 07:23:57','网也。从网𣫭聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('叜','13752',NULL,NULL,NULL,'灾',NULL,'又',NULL,NULL,NULL,NULL,NULL,'2024-01-21 18:57:56','老也。从又从灾。闕。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𠬝','13753',NULL,NULL,NULL,'卪','又',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 19:01:13','治也。从又从卪。卪，事之節也。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('奪','13754',NULL,NULL,NULL,'奞',NULL,'寸',NULL,NULL,NULL,NULL,NULL,'2024-01-21 19:04:46','手持隹失之也。从又从奞。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𣦼','13755',NULL,'歺',NULL,NULL,NULL,NULL,NULL,'又',NULL,NULL,NULL,'2024-01-21 21:11:17','殘穿也。从又从歺。凡𣦼之屬皆从𣦼 。讀若殘。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𠭯','13756',NULL,NULL,NULL,NULL,'虘',NULL,NULL,'又',NULL,NULL,NULL,'2024-01-21 19:07:07','又卑也。从又虘聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𠭰','13757','未',NULL,NULL,NULL,'厂','又','攵',NULL,NULL,NULL,NULL,'2024-01-21 19:08:34','引也。从又𠩺聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𠭙','13758',NULL,NULL,NULL,NULL,'𢑚','又',NULL,NULL,NULL,NULL,NULL,'2024-01-21 19:11:16','引也。从又𢑚聲。𢑚，古文申。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䅓','13759',NULL,'禾',NULL,NULL,'句',NULL,NULL,'又',NULL,NULL,NULL,'2024-01-21 19:14:33','䅩䅓也。从𥝌从又，句聲。又者，从丑省。一曰木名。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('黃','13760',NULL,NULL,NULL,NULL,'炗',NULL,NULL,NULL,NULL,NULL,'田','2024-01-21 19:21:09','地之色也。从田从炗，炗亦聲。炗，古文光。凡黃之屬皆从黃。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𤲬','13761',NULL,'田',NULL,NULL,'耎',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 19:21:38','城下田也。一曰𤲬，郤也。从田耎聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('畬','13762',NULL,NULL,NULL,'余',NULL,'田',NULL,NULL,NULL,NULL,NULL,'2024-01-21 19:22:00','三歲治田也。《易》曰：“不葘，畬田。”从田余聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('畱','13763',NULL,NULL,NULL,'丣',NULL,'田',NULL,NULL,NULL,NULL,NULL,'2024-01-21 19:22:53','止也。从田丣聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('當','13764',NULL,NULL,NULL,'尚',NULL,'田',NULL,NULL,NULL,NULL,NULL,'2024-01-21 19:23:44','田相值也。从田尚聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('㱳','13765',NULL,NULL,NULL,NULL,'莫','歹',NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:10:22','死𡧯㱳也。从歺莫聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('饗','13766',NULL,NULL,NULL,'鄉',NULL,'食',NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:15:12','鄉人飲酒也。从食从鄉，鄉亦聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𩛥','13767','才',NULL,'食',NULL,NULL,NULL,NULL,'丮',NULL,NULL,NULL,'2024-01-21 21:16:17','設飪也。从丮从食，才聲。讀若載。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𩟷','13768',NULL,NULL,NULL,'雝',NULL,'食',NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:16:47','孰食也。从食雝聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𩛿','13769',NULL,'饣',NULL,NULL,'易',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:17:22','飴和饊者也。从食易聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('養','13770',NULL,NULL,NULL,'羊',NULL,'食',NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:19:03','供養也。从食羊聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𩞑','13771',NULL,'饣',NULL,NULL,'𠦪',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:21:10','滫飯也。从食𠦪聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('餥','13772',NULL,NULL,NULL,'非',NULL,'食',NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:23:26','𩝍也。从食非聲。陳楚之閒相謁食麥飯曰餥。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('㼝','13773',NULL,NULL,NULL,NULL,'夗','瓦',NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:26:34','小盂也。从瓦夗聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𤬯','13774',NULL,'瓦',NULL,NULL,'今',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:27:31','治橐榦也。从瓦今聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('瓪','13775',NULL,'瓦',NULL,NULL,'反',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:28:01','敗也。从瓦反聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('瓽','13776',NULL,NULL,NULL,NULL,'尚','瓦',NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:28:21','大盆也。从瓦尚聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䯏','13777',NULL,'骨',NULL,NULL,'舌',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:32:00','骨耑也。从骨𠯑聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𪑙','13778',NULL,'黑',NULL,NULL,'金',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:35:07','黃黑也。从黑金聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䵵','13779',NULL,NULL,NULL,'算',NULL,'黑',NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:35:45','黃黑而白也。从黑算聲。一曰短黑。讀若以芥爲齏，名曰芥荃也。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('黨','13780',NULL,NULL,NULL,'尚',NULL,'黑',NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:36:16','不鮮也。从黑尚聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𪑝','13781',NULL,'黑',NULL,NULL,'或',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:37:26','羔裘之縫。从黑或聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䵤','13782',NULL,NULL,NULL,'幵',NULL,'黑',NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:37:53','黑皴也。从黑幵聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('儵','13783',NULL,NULL,NULL,NULL,'攸','黑',NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:38:20','青黑繒縫白色也。从黑攸聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('黶','13784',NULL,NULL,NULL,NULL,'厭','黑',NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:38:44','申黑也。从黑厭聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('黳','13785',NULL,NULL,NULL,'殹',NULL,'黑',NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:39:28','小黑子。从黑殹聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('彎','13786',NULL,NULL,NULL,'䜌',NULL,'弓',NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:49:29','持弓關矢也。从弓䜌聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䜌','13787',NULL,'糸',NULL,NULL,'言',NULL,NULL,'糸',NULL,NULL,NULL,'2024-01-21 21:50:48','','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('瓕','13788',NULL,'弓',NULL,NULL,'璽',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:52:31','弛弓也。从弓璽聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𢏗','13789',NULL,NULL,NULL,'幵',NULL,'弓',NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:52:54','帝嚳䠶官，夏少康滅之。从弓幵聲。《論語》曰：“𢏗善䠶。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𢦚','13790',NULL,'戈',NULL,NULL,'丮',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 21:55:14','擊踝也。从丮从戈。讀若踝。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𩰎','13791',NULL,NULL,NULL,NULL,'鬥',NULL,NULL,NULL,NULL,NULL,'戈','2024-01-21 21:55:43','試力士錘也。从鬥从戈。或从戰省。讀若縣。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𢧜','13792','十','口','王',NULL,NULL,NULL,NULL,'戈',NULL,NULL,NULL,'2024-01-21 22:01:18','大也。从大𢧄聲。讀若《詩》“𢧜𢧜大猷”。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𢧄','13793',NULL,NULL,NULL,NULL,'呈',NULL,NULL,'戈',NULL,NULL,NULL,'2024-01-21 22:00:08','利也。一曰剔也。从戈呈聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𢦔','13794','才',NULL,NULL,NULL,'戈',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 22:02:43','傷也。从戈才聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𦨉','13795',NULL,NULL,NULL,NULL,'舟',NULL,NULL,'刂',NULL,NULL,NULL,'2024-01-21 22:08:38','船行不安也。从舟，从刖省。讀若兀。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('䀇','13796','古',NULL,NULL,NULL,NULL,'皿','缶',NULL,NULL,NULL,NULL,'2024-01-21 22:14:07','器也。从皿从缶，古聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('盧','13797',NULL,NULL,NULL,'虍','田','皿',NULL,NULL,NULL,NULL,NULL,'2024-01-21 22:16:05','飯器也。从皿𧇄聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𥁑','13798',NULL,NULL,NULL,'必',NULL,'皿',NULL,NULL,NULL,NULL,NULL,'2024-01-21 22:16:31','械器也。从皿必聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𣂞','13799',NULL,NULL,NULL,NULL,'良',NULL,NULL,'斤',NULL,NULL,NULL,'2024-01-21 22:25:37','柯擊也。从斤良聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𣂆','13800','','旁','',NULL,NULL,NULL,NULL,'斗',NULL,NULL,NULL,'2025-02-16 12:31:36',replace('量溢也。从斗㫄聲。\n\n旁','\n',char(10)),'Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𣂀','13801',NULL,NULL,NULL,NULL,'𠩓',NULL,NULL,'斗',NULL,NULL,NULL,'2024-01-21 22:29:30','斛㫄有𣂀。从斗𠩓聲。一曰突也。一曰利也。《尔疋》曰：“𣂀謂之疀。”古田器也。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('㪻','13802',NULL,NULL,NULL,'䜌',NULL,'斗',NULL,NULL,NULL,NULL,NULL,'2024-01-21 22:29:54','杼滿也。从斗䜌聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𠨲','13803',NULL,NULL,NULL,'之','厂',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 22:37:01','岸上見也。从厂，从之省。讀若躍。','Y',NULL,'incomplete','');
INSERT INTO zn_zi_part VALUES('𠩘','13804','厂',NULL,NULL,NULL,'夾',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 22:40:10','𠪮也。从厂夾聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𠪙','13805','厂',NULL,NULL,NULL,'異',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-21 22:42:22','石利也。从厂異聲。讀若枲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('異','13806',NULL,NULL,NULL,'田',NULL,'共',NULL,NULL,NULL,NULL,NULL,'2024-01-21 22:43:52','分也。从廾从畀。畀，予也。凡異之屬皆从異。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('癹','13807','?',NULL,NULL,NULL,NULL,'殳','?',NULL,NULL,NULL,NULL,'2025-02-16 12:38:38','','Y',NULL,'incomplete','');
INSERT INTO zn_zi_part VALUES('㲃','13808','白',NULL,'匕',NULL,NULL,NULL,NULL,'殳',NULL,NULL,NULL,'2024-01-23 21:50:56','','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𣪯','13809',NULL,'宮',NULL,NULL,'',NULL,NULL,'殳',NULL,NULL,NULL,'2025-02-16 12:51:25','擊空聲也。从殳宮聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𣫐','13810',NULL,'寿',NULL,NULL,'',NULL,NULL,'殳',NULL,NULL,NULL,'2025-02-16 12:51:14','縣物𣪐擊。从殳𠃬聲。','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('祋','13811',NULL,'礻',NULL,NULL,'',NULL,NULL,'殳',NULL,NULL,NULL,'2025-02-16 12:51:00','殳也。从殳示聲。或說城郭市里，高縣羊皮，有不當入而欲入者，暫下以驚牛馬曰祋。故从示、殳。《詩》曰：“何戈與祋。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𡚾','13812',NULL,'女',NULL,NULL,'',NULL,NULL,'殳',NULL,NULL,NULL,'2025-02-16 12:50:46','好也。从女殳聲。《詩》曰：“靜女其𡚾。”','Y',NULL,'','');
INSERT INTO zn_zi_part VALUES('𥪋','13813',NULL,'立',NULL,NULL,'录',NULL,NULL,NULL,NULL,NULL,NULL,'2024-01-23 22:00:52','見鬼鬽皃。从立从录。录，籒文鬽字。讀若虙羲氏之虙。','Y',NULL,'','');
